(53,	'105015',	'5c5031e91558496583c9776d96f02a8c',	'105015 Orgaboxen für DIN A 5 Hart, sw',	'[{\"name\": \"105015\", \"type\": \"jpg\"}]',	9.2,	25,	8.55,	44,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:05',	20,	'<p>aus Hartpappe für DIN A5 Formate<br/>Sie wird flach geliefert und benötigt daher wenig Lagerraum. Im Handumdrehen ist sie durch den leicht bedienbaren Schnappverschluss aufgestellt.</p><strong>Material: </strong>Hartpappe<br><strong>Farbe: </strong>schwarz<br><strong>Stärke: </strong>1,3 mm<br><strong>Breite: </strong>238 mm<br><strong>Höhe: </strong>165 mm<br><strong>Tiefe: </strong>105 mm</p>',	'aus Hartpappe für DIN A5 Formate mit Marmorierung',	'105015-Orgaboxen-fuer-DIN-A-5-Hart-sw'),
(54,	'114523',	'0a91141b34d74f09a67cd4cf2325e45e',	'114523 Lateralboxen (Archivboxen) weiß',	'[{\"name\": \"114523\", \"type\": \"jpg\"}]',	2.9,	0,	NULL,	0,	0,	10,	10,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:05',	20,	'seitlich offen, für lateral (seitlich) bereiterte Orga-Mappen<br><br>In Regalen und Schränken untergebracht, bildet sie die Lateralablage. Vorteil: Mappen können direkt eingesehen und gegriffen werden, ohne die Box zu entnehmen. Nachteil: schlechte Unterbringung am Schreibtisch. <br><br><b>Material:</b> Feinwelle<br><b>Farbe:</b> weiß<br><b>Breite:</b> 315 mm<br><b>Höhe:</b> 230 mm<br><b>Tiefe:</b> 95 mm<br>',	'seitlich offen, für lateral (seitlich) bereiterte Orga-Mappen',	'114523-Lateralboxen-Archivboxen-weiss'),
(55,	'134050',	'a897ed30235d4554a855cfa7c8d92f44',	'134050 Dehnsammler',	'[{\"name\": \"134050\", \"type\": \"jpg\"}, {\"name\": \"134050_02\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schreibtisch\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	4.95,	10,	4.75,	3339,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:06',	20,	'<p>kann im Gegensatz zum festen Sammler ArtNr. 144150 beliebig bis auf 60 mm erweitert werden<br><br>Er ist vorgesehen, eine Vielzahl von Orga-Mappen zusammenzufassen oder Kataloge, Broschüren oder voluminöses Ablagegut aufzunehmen. Durch die Erweiterungs-Möglichkeit kann er der jeweils wachsenden Füllmenge angepasst werden. Dabei wird die Vorderwand mit Hilfe der Rillungen entsprechend höher abgeknickt und mit der Klemmschiene fixiert. Ausgerüstet mit einer Zwischenheftvorrichtung wird der Dehn-Sammler zum Hefter, der zu heftendes Schriftgut aufnimmt und das Dazu- und Zwischenheften erleichtert. Dehn-Sammler mit Inhalt lässt sich flach aufschlagen wie ein Buch.<br><br><b>Tipp:</b> Zur Bereiterung Fenster-Reiter ArtNr. 410150 oder selbstklebende Schiebeleiste ArtNr. 570070 mit verschiebbaren Fenster-Reiter ArtNr. 410357 und austauschbaren Schildchen verwenden<br><br><b>Material:</b> Chromoduplex 500 g/m²<br><b>Farbe:</b> grün<br><b>Blattkapazität:</b> bis 600 bei 80 g Papier<br><b>Breite:</b> 320 mm<br><b>Höhe:</b> 225 mm<br><b>Tiefe:</b> 10 mm - 60 mm<br></p>',	'kann im Gegensatz zum festen Sammler ArtNr. 144150 beliebig bis auf 60 mm erweitert werden',	'134050-Dehnsammler'),
(56,	'144050',	'7659f742510043078a376fab6f1a00d7',	'144050 Dehn-Hefter grün',	'[{\"name\": \"144050\", \"type\": \"jpg\"}, {\"name\": \"144050_02\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schreibtisch\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	6.15,	10,	5.8,	71,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:06',	20,	'lässt sich wie der Dehn-Sammler ArtNr. 134050 von 10 mm - 60 mm erweitern und ist ausgestattet mit einer Zwischen-Heftvorrichtung (Kunststoff-Heftung), die das Dazu- und Zwischen- heften von Schriftstücken erleichtert<br><br>Er lässt sich flach aufschlagen wie ein Buch und hat ein Fassungsvermögen bis zu 50 mm. <br><br>Tipp: Zur Bereiterung Fensterreiter ArtNr. 410150 oder selbstklebende Schiebeleiste ArtNr. 570070 mit verschiebbaren Fensterreiter ArtNr. 410357 und austauschbaren Schildchen verwenden<br><br><b>Material:</b> Chromoduplex 500 g/m²<br><b>Farbe:</b> grün<br><b>Blattkapazität:</b> bis 500 bei 80 g Papier<br><b>Breite:</b> 320 mm<br><b>Höhe:</b> 225 mm<br><b>Tiefe:</b> 10 mm-60 mm<br>',	'lässt sich wie der Dehn-Sammler ArtNr. 134050 von 10 mm - 60 mm erweitern und ist ausgestattet mit einer Zwischen-Heftvorrichtung (Kunststoff-Heftung), die das Dazu- und Zwischen- heften von Schriftstücken erleichtert',	'144050-Dehn-Hefter-gruen'),
