(64,	'204009',	'b9627aaeb2d3417ca4f87527ce2408e9',	'204009 Orgamappen 90 hb',	'[{\"name\": \"204009\", \"type\": \"jpg\"}, {\"name\": \"beispiel_orga-tabs\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schreibtisch\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	30.5,	250,	29.95,	0,	100,	50,	10,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:10',	20,	'<p>\r\nnehmen Ihre Dokumente sicher und geschützt auf.\r\n<br>\r\nEine universelle Organisationsleiste bietet eine Vielfalt an Einsatzmöglichkeiten. Integrierte Seitenklappen schützen Ihre Dokumente gegen Herausfallen und geben der Mappe Standstabilität. Sie ist schon wirtschaftlich bei Aufbewahrung von wenigen Schriftstücken. Daher ist sie ideal für dünne Vorgänge und größere Unterteilungen der Ablage. Das ist wichtig, denn klein gehaltene Vorgänge erhöhen die Ordnungssystematik.\r\n</p>\r\n<p>\r\n<b><span style=\"color: #ff0000;\">Hinweis:</span> Bedenken Sie, dass diese Mappe sehr dünn ist - etwas stärker wie ein Blatt Kopierpapier (80 g/m²) und für seltenen Aktenzugriff mit wenigen Schriftstücken gedacht ist. Für den normalen Büroeinsatz empfehlen wir Orga-Mappen ab einem Papiergewicht von 120 g/m².</b>\r\n</p>\r\n<p>\r\n<b>Material:</b> Natronkraft 90 g/m²<br>\r\n<b>Farbe:</b> hellbraun<br>\r\n<b>Blattkapazität:</b> bis 20 bei 80 g Papier<br>\r\n<b>Außenmaße:</b> B 315 mm x H 225 mm\r\n</p>',	'nehmen Ihre Dokumente sicher und geschützt auf',	'204009-Orgamappen-90-hb'),
