(82,	'204450TU',	'e5338d97fd7a441294a936f1129e4127',	'204450TU Klarsichtmappen, 250 g/qm mit TU',	'[{\"name\": \"204450TU\", \"type\": \"jpg\"}, {\"name\": \"204450TU_02\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schreibtisch\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	239.7,	100,	234.95,	101,	100,	20,	10,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:17',	20,	'nehmen Ihre Dokumente sicher und geschützt auf<br><br>Eine universelle Organisationsleiste bietet eine Vielfalt an Einsatzmöglichkeiten. Integrierte Seitenklappen schützen Ihre Dokumente gegen Herausfallen und geben der Mappe Standstabilität. Zusätzlich ist diese Mappe an der Mappen-Rückseite außen mit einem Tab-Umsetzer, Art. 57 00 71 versehen. Das ist ein Spezial-Klebestreifen, der es ermöglicht die Beschriftungsreiter Quick-Tab, rückstandsfrei wieder abzulösen und die Mappe wieder zu verwenden.\r\n. <br><br><b>Material:</b> transparente, glasklare Kunststoff-Folie PET, 250 g/qm<br><b>Blattkapazität:</b> bis 100 bei 80 g Papier<br><b>Außenmaße:</b> B 315 mm x H 225 mm<br>',	'besteht aus glasklarer Kunststofffolie, 250 g/qm, mit Organisationsdruck und ist an der Mappen-Rückseite außen mit einem Tab-Umsetzer, Art. 57 00 71 versehen. Das ist ein Spezial-Klebestreifen, der es ermöglicht die Beschriftungsreiter Quick-Tab, rückstandsfrei wieder abzulösen und die Mappe wieder zu verwenden.',	'204450TU-Klarsichtmappen-250-g/qm-mit-TU'),
(83,	'204451',	'8d82f7de166142ae91f728188701d13b',	'204451 Klarsichtmappen, transparent, 250 g/qm',	'[{\"name\": \"204451\", \"type\": \"jpg\"}, {\"name\": \"204451_02\", \"type\": \"jpg\"}, {\"name\": \"204451_03\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schreibtisch\", \"type\": \"jpg\"}]',	214.65,	100,	207.7,	1536,	100,	20,	10,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:17',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n<span style=\"font-size:20px;color: #000000;\">Die neue wiederverwendbare Orga-Mappe</span>\r\n</p>\r\n<div class=\"responsive-video\"><iframe src=\"https://player.vimeo.com/video/340139648?title=0&amp;byline=0&amp;color=ff9933&amp;autoplay=0\" width=\"500\" height=\"281\" frameborder=\"0\" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe></div>  <p>In diesem Video zeigen wir welche Vorteile die neue Sichtmappe hat. </p>\r\n<p>\r\n<p>Sie besteht aus glasklarer Kunststoff-Folie, 250 g/qm und eine universelle Organisationsleiste bietet eine Vielfalt an Einsatzmöglichkeiten. An der hochstehenden, transparenten Rückwand wird der Inhalt mit wiederablösbaren Etiketten (Quick-Strip, Art. 59 10 ..) gekennzeichnet. Sie ist somit mehrfach verwendbar und ideal für unklare oder schwebende Vorgänge. Integrierte Seitenklappen schützen Ihre Dokumente gegen Herausfallen und geben der Mappe Standstabilität. Sie ist schon wirtschaftlich bei Aufbewahrung von wenigen Schriftstücken. Daher ist sie ideal für dünne Vorgänge und größere Unterteilungen der Ablage. Das ist wichtig, denn klein gehaltene Vorgänge erhöhen die Ordnungssystematik.</p><p><b>Material:</b> transparente, glasklare Kunststoff-Folie, 250 g/qm<br><b>Blattkapazität:</b> bis 100 bei 80 g Papier<br><b>Außenmaße:</b> B 315 mm x H 236 mm</p>\r\n<p style=\"color:#ff0000\">\r\n<strong>Beschriftung:</strong>\r\nQuick-Strip, 59 10 .. (Farben: 00 weiss, 01 gelb, 02 rot, 06 grün)<p>',	'Sie besteht aus glasklarer Kunststoff-Folie, 250 g/qm und eine universelle Organisationsleiste bietet eine Vielfalt an Einsatzmöglichkeiten. Integrierte Seitenklappen schützen Ihre Dokumente gegen Herausfallen und geben der Mappe Standstabilität.<br>\r\n<br>\r\n<strong>Beschriftung:</strong>\r\nQuick-Strip, 59 10 .. (Farben: 00 weiss, 01 gelb, 02 rot, 06 grün)',	'204451-Klarsichtmappen-transparent-250-g/qm'),
(84,	'204461',	'63dfab035bbf44adac084fe3e10365f8',	'204461 Multi-Funktionsmappe, PP ohne Schiebeleiste',	'[{\"name\": \"204461\", \"type\": \"jpg\"}, {\"name\": \"204461_02\", \"type\": \"jpg\"}, {\"name\": \"beispiel_strip-tabs\", \"type\": \"jpg\"}, {\"name\": \"900006\", \"type\": \"jpg\"}]',	3.05,	0,	2.8,	290,	0,	10,	10,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:18',	20,	'<p>Sie besteht aus extra-starker, transluzenter PP-Kunststoff-Folie, Ausführung wie 20 44 62 nur ohne Schiebeleiste. Integrierte Seitenklappen schützen Ihre Dokumente gegen Herausfallen und geben der Mappe Standstabilität. Sie ist schon wirtschaftlich bei Aufbewahrung von wenigen Schrift-stücken. Daher ist sie ideal für dünne Vorgänge und größere Unterteilungen der Ablage. Das ist wichtig, denn klein gehaltene Vorgänge erhöhen die Ordnungssystematik. </p><p><b>Material:</b> transluzente PP-Kunststoff-Folie, 400 g/m²<br><b>Blattkapazität:</b> bis 120 bei 80 g Papier<br><b>Außenmaße:</b> B 315 mm x H 225 mm</p>',	'Sie besteht aus extra-starker, transluzenter PP-Kunststoff-Folie, Ausführung wie 20 44 62 nur ohne Schiebeleiste',	'204461-Multi-Funktionsmappe-PP-ohne-Schiebeleiste'),
(85,	'204462',	'725a2dcc280d48e396aea5626d1cc0de',	'204462 Multi-Funktionsmappe, PP, mit Schiebereiter',	'[{\"name\": \"204462\", \"type\": \"jpg\"}, {\"name\": \"204462_02\", \"type\": \"jpg\"}, {\"name\": \"beispiel_strip-tabs\", \"type\": \"jpg\"}, {\"name\": \"900006\", \"type\": \"jpg\"}]',	4.1,	0,	NULL,	572,	0,	10,	10,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:18',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n<span style=\"font-size:20px;color: #000000;\">Die Multifunktionsmappe mit Schiebereiter:</span>\r\n</p><div class=\"responsive-video\"><iframe src=\"https://player.vimeo.com/video/81796082?byline=0&amp;color=ff9933&amp;autoplay=0&amp;loop=1\" width=\"500\" height=\"282\" frameborder=\"0\" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe></div>\r\n<p>Mit der neuen, verbesserten Multifunktions-Mappe bringt Classei echten Mehrfachnutzen in den Büroalltag mit Papierdokumenten. Sie besteht aus robustem, durchsichtigem Polypropylen. Das macht die Mappe wesentlich haltbarer als herkömmliche PVC-Mappen oder - Hüllen und ist recyclebar.<p/>\r\n<p>Durch den verschiebbaren Fensterreiter ist sie hervorragend für schwebende oder noch nicht klar zugeordnete Vorgänge, Projekte und Aktionen geeignet. Sie kann so mehrfach verwendet werden. Der Fensterreiter an der integrierten Schiebeleiste lässt sich mühelos mit neuer Beschriftung auf eine neue Position verschieben.</p>\r\n<p>Mit Visitenkarten-Klemmschlitze an unterer Seitenklappe und für sicheren Aktentransport können Sicherungslaschen stufenweise in Schlitze eingesteckt werden.</p>\r\n<p>Passenden Einsteckschildchen aus stabilem Karton. Art. 60 10 .. sind in 10 Farben (00-09) erhältlich und im Handumdrehen neu beschriftet und einzustecken. <strong>Im Set sind 1 Bogen neutrale weisse Schildchen enthalten. Auf Wunsch können Sie die Farbe ändern. Geben Sie dies bitte bei Ihrer Bestellung mit an.</strong></p>\r\n<p>Passende wiederablösbare Beschriftungsetiketten, Art. 59 10 .. sind in 4 Farben (00 weiss, 01 gelb, 02 rot, 06 grün) erhältlich und im Handumdrehen beschriftet und aufgeklebt. <strong>Im Set sind 1 Bogen neutrale weisse Etiketten enthalten. Auf Wunsch können Sie die Farbe ändern. Geben Sie dies bitte bei Ihrer Bestellung mit an.</strong></p><p><b>Material:</b> transluzente PP-Kunststoff-Folie, 400 g/m²<br><b>Blattkapazität:</b> bis 120 bei 80 g Papier<br><b>Außenmaße:</b> B 315 mm x H 225 mm</p>',	'Sie besteht aus extra-starker, transluzenter PP-Kunststoff-Folie. An einer integrierten Schiebeleiste befindet sich ein verschiebbarer Fenster-Reiter, dessen Beschriftung mit verschiedenfarbigen Einsteck-Schildchen geändert werden kann. Er ist leicht auf eine neue Position zu schieben. Die Multifunktions-Mappe ist daher hervorragend geeignet für kurzfristige oder schwebende Vorgänge. Sie kann so mehrfach wieder verwendet werden. Für die austauschbaren Einsteck-Schildchen wird der Strip-Bogen (ArtNr. 6010..) in zehn Farben verwendet.',	'204462-Multi-Funktionsmappe-PP-mit-Schiebereiter'),
(86,	'204550',	'08e41f7da1dc41ec869a90fa8da785c9',	'204550 Klarsichtmappen Hart PVC, ohne Orgadruck',	'[{\"name\": \"204550\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schreibtisch\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	165.95,	100,	158.2,	117,	100,	10,	10,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:19',	20,	'nimmt Ihre Dokumente sicher auf<br><br>Integrierte Seitenklappen schützen Ihre Dokumente gegen Herausfallen und geben der Mappe Standstabilität. Sie ist schon wirtschaftlich bei Aufbewahrung von wenigen Schrift- stücken. Daher ist sie ideal für dünne Vorgänge und größere Unterteilungen der Ablage. Das ist wichtig, denn klein gehaltene Vorgänge erhöhen die Ordnungssystematik. <br><br><b>Material:</b> transparente Kunststoff-Folie, ohne Orgadruck <br><b>Außenmaße:</b> B 315 mm x H 225 mm<br>',	'nimmt Ihre Dokumente sicher auf',	'204550-Klarsichtmappen-Hart-PVC-ohne-Orgadruck'),
