(96,	'224453',	'a7a0d2925b964b6596e5d27a05e14a87',	'224453, Blättersicht-Mappe, transparent',	'[{\"name\": \"224453\", \"type\": \"jpg\"}, {\"name\": \"224453_02\", \"type\": \"jpg\"}, {\"name\": \"224453_03\", \"type\": \"jpg\"}, {\"name\": \"224453_04\", \"type\": \"jpg\"}]',	100.85,	100,	94.5,	11626,	100,	20,	20,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:23',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\"><span style=\"font-size:20px;color: #000000;\">Die neue Blättersicht-Mappe ändert alles:</span></p><div class=\"responsive-video\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"281\" mozallowfullscreen=\"\" src=\"https://player.vimeo.com/video/170149734?title=0&amp;byline=0&amp;color=ff9933&amp;autoplay=0\" webkitallowfullscreen=\"\" width=\"500\"></iframe></div>\r\n<p>\r\n<br>Die stabile Sicht-Mappe ist mit einer Ordnungsskala versehen und hat das Classei-Mappen-Format. Sie können den Inhalt mit wiederablösbaren Beschriftungsetiketten kennzeichnen und in die bestehende Classei-Ordnung einfügen. Diese Blättersicht-Mappe ist daher ideal für kurzfristige oder schwebende Vorgänge und kann somit mehrfach verwendet werden.</p></p>\r\nDer Inhalt der einliegenden Blätter bleibt zum Lesen oder Bearbeiten in der Mappe und ist somit blätterfähig. Die Blätter werden am Heftrand festgehalten, dadurch kann in dem Inhalt wie in einem Katalog geblättert werden.<br>\r\n<p>\r\n<strong>Material:</strong>\r\nPP-Klarsichtfolie, 190\r\n<br>\r\n<strong>Breite:</strong>\r\n315 mm\r\n<br>\r\n<strong>Höhe:</strong>\r\n235 mm\r\n<br>\r\n<strong>Füllvolumen:</strong>\r\n20 Blatt\r\n<br>\r\n<br>\r\n<strong>Beschriftung:</strong>\r\nQuick-Strip, 59 10 .. (Farben: 00 weiss, 01 gelb, 02 rot, 06 grün)\r\n\r\n</p>',	'<p>Sie besteht aus starker PP-Folie, 190 g/qm. Der Inhalt der einliegenden Blätter bleibt zum Lesen oder Bearbeiten in der Sichtmappe. Durch die aufgedruckte Organisationsleiste und den wiederablösbaren QuickStrips sind die Blättersicht-Mappen voll in die Classei-Ablage integrierbar.<br/> <br/><strong>Hinweis: </strong><br/>Zum Beschriften der Mappe verwenden Sie <strong>QuickStrip 59 10 ..</strong></p>',	'224453-Blaettersicht-Mappe-transparent'),
(97,	'224453P',	'56bde5e9f91945abacc67920bfe1a7d9',	'224453P, Blättersicht-Mappen-Set, transparent',	'[{\"name\": \"224453p\", \"type\": \"jpg\"}, {\"name\": \"224453_02\", \"type\": \"jpg\"}, {\"name\": \"224453_03\", \"type\": \"jpg\"}, {\"name\": \"224453_04\", \"type\": \"jpg\"}]',	24.35,	0,	NULL,	18,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:23',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\"><span style=\"font-size:20px;color: #000000;\">Die neue Blättersicht-Mappe ändert alles:</span></p><div class=\"responsive-video\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"281\" mozallowfullscreen=\"\" src=\"https://player.vimeo.com/video/170149734?title=0&amp;byline=0&amp;color=ff9933&amp;autoplay=0\" webkitallowfullscreen=\"\" width=\"500\"></iframe></div>\r\n<p>Die stabile Sicht-Mappe ist mit einer Ordnungsskala versehen und hat das Classei-Mappen-Format. Sie können den Inhalt mit wiederablösbaren Beschriftungsetiketten kennzeichnen und in die bestehende Classei-Ordnung einfügen. Diese Blättersicht-Mappe ist daher ideal für kurzfristige oder schwebende Vorgänge und kann somit mehrfach verwendet werden.</p></p>\r\n<p>\r\n<strong>Material:</strong>\r\nPP-Klarsichtfolie, 190\r\n<br>\r\n<strong>Breite:</strong>\r\n315 mm\r\n<br>\r\n<strong>Höhe:</strong>\r\n235 mm\r\n<br>\r\n<strong>Füllvolumen:</strong>\r\n20 Blatt\r\n<br>\r\n<br>\r\n<strong>Set-Inhalt:</strong>\r\n20 Blättersicht-Mappen, 5 Bögen Quick-Strip, 59 10 00 weiss',	'<p>Der Inhalt der einliegenden Blätter bleibt zum Lesen oder Bearbeiten in der Sichtmappe. Die Classei-Sichtmappe ist somit blätterungsfähig geworden.<br><br><strong>Set-Inhalt:</strong></p><ul><li>20 x Blätter-Sichtmappen</li><li> 5 x Quick-Strip, 59 10 00, weiß</li></ul>',	'224453P-Blaettersicht-Mappen-Set-transparent'),
(98,	'224551',	'af00f68939f148379507255433dff45c',	'224551 Transparenthüllen',	'[{\"name\": \"224551\", \"type\": \"jpg\"}]',	52,	150,	48.3,	0,	100,	20,	10,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:24',	20,	'<p>wird bei der Kombi-Mappe als Vorderseite eingeklebt, kann aber auch universell verwendet werden <br><br>Dokumente oder Datenblätter sind so geschützt und separat aufbewahrt. Alle wichtigen Daten sind direkt sichtbar. Die Datenblätter sind leicht austauschbar. <br><br><b>Material:</b> Klarsichtfolie<br><b>Maße:</b> B 315 mm x H 222 mm</p>',	'wird bei der Kombi-Mappe (ArtNr. 224113) oder Klarsicht-Kombi-Mappe (ArtNr. 224413) als Vorderseite eingeklebt, kann aber auch universell verwendet werden ',	'224551-Transparenthuellen'),
(99,	'224553',	'7952c1e072a0442eb188cd1e575d6c75',	'224553, Blättersicht-Hülle, transparent',	'[{\"name\": \"224553\", \"type\": \"jpg\"}, {\"name\": \"224553_02\", \"type\": \"jpg\"}, {\"name\": \"224553_03\", \"type\": \"jpg\"}, {\"name\": \"224553_04\", \"type\": \"jpg\"}]',	44,	100,	40.95,	9993,	100,	20,	20,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:24',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n<span style=\"font-size:20px;color: #000000;\">Die neue Sichth&uuml;lle &auml;ndert alles:</span>\r\n</p>\r\n<div class=\"responsive-video\"><iframe src=\"https://player.vimeo.com/video/85354439?title=0&amp;byline=0&amp;color=ff9933&amp;autoplay=0\" width=\"500\" height=\"281\" frameborder=\"0\" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe></div>  <p>In diesem Video zeigen wir welche Vorteile die neue Sichth&uuml;lle hat. </p>\r\n<p>\r\n	Der <strong>Inhalt</strong> der einliegenden Bl&auml;tter bleibt zum Lesen oder Bearbeiten in der \r\n	Sichthülle. Die Classei-Sichthülle ist somit blätterungsfähig geworden.  \r\n	Die Blätter werden am Heftrand festgehalten, dadurch kann in dem Inhalt wie in einem \r\n	Katalog geblättert werden.\r\n</p>\r\n<p>\r\n	<strong>Ein Schritt weiter:</strong>\r\n	<br>\r\nDie mit Vorgängen gefüllten Sichthüllen müssen jetzt nicht auf dem Schreibtisch herumliegen. Sie können auf vorstehenden Rückwand beschriftet werden zu mehreren geordnet „verpackt\" unter einem Namen, Titel oder einer beliebigen Bezeichnung in einer Classei-Orgamappe abgelegt werden. Hinweis: Sichthülle ohne Orgadruck\r\n\r\n</p>\r\n<p>\r\n<strong>Material:</strong>\r\nPP-Klarsichtfolie, 160\r\n<br>\r\n<strong>Breite:</strong>\r\n310 mm\r\n<br>\r\n<strong>Höhe:</strong>\r\n220 mm\r\n<br>\r\n<strong>Füllvolumen:</strong>\r\n20 Blatt\r\n<br>\r\n\r\n</p>',	'Der Inhalt der einliegenden Blätter bleibt zum Lesen oder Bearbeiten in der Sichtmappe. Die Classei-Sichtmappe ist somit blätterungsfähig geworden.',	'224553-Blaettersicht-Huelle-transparent'),
(100,	'224816',	'b3fde7b7dcc6463e8dc893b2e454973c',	'224816 Orgamappen mit Sichtfenster',	'[{\"name\": \"224816\", \"type\": \"jpg\"}, {\"name\": \"beispiel_orga-tabs\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schreibtisch\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	56,	250,	50.95,	3141,	100,	50,	10,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:11:24',	20,	'<p>\r\nnimmt Ihre Dokumente sicher auf.\r\n</p>\r\n<p>\r\nDurch das Sichtfenster auf der Mappen-Vorderseite haben Sie Sicht auf Ihr 1. Dokument.\r\n</p>\r\n<p>\r\nEine universelle Organisationsleiste bietet eine Vielfalt an Einsatzmöglichkeiten. Integrierte Seitenklappen schützen Ihre Dokumente gegen Herausfallen und geben der Mappe Standstabilität. Sie ist schon wirtschaftlich bei Aufbewahrung von wenigen Schriftstücken. Daher ist sie ideal für dünne Vorgänge und größere Unterteilungen der Ablage. Das ist wichtig, denn klein gehaltene Vorgänge erhöhen die Ordnungssystematik.\r\n</p>\r\n<p>\r\n<b>Material:</b> Natronkraft 160 g/m²<br>\r\n<b>Farbe:</b> hellgelb<br>\r\n<b>Blattkapazität:</b> bis 80 bei 80 g Papier<br>\r\n<b>Außenmaße:</b> B 315 mm x H 225 mm\r\n</p>',	'nehmen Ihre Dokumente sicher und geschützt auf',	'224816-Orgamappen-mit-Sichtfenster'),
