(271,	'466070',	'53dcc0167eb74cfeb37428a0dff7149d',	'466070 Planer, Leder schwarz',	'[{\"name\": \"466070\", \"type\": \"jpg\"}]',	17,	0,	NULL,	4,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:12:34',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n<span style=\"font-size:20px;color: #000000;\">So einfach funktioniert ZPM:</span>\r\n</p>\r\n<div class=\"responsive-video\">\r\n<iframe src=\"https://player.vimeo.com/video/32567030?title=0&amp;byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff&amp;autoplay=0\" width=\"500\" height=\"281\" frameborder=\"0\" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe></div> \r\n<p>&nbsp;</p>\r\n<p>In diesem Video zeigen wir wie einfach es ist, alle Termine im &Uuml;berblick zu behalten. Alle. Immer.</p>\r\n<p>für Aufzeichnungen und Notizen unterwegs<br><br>Im handlichen DIN A6-Format ist er ausgestattet mit einem Einband aus echtem Rindleder mit edlem Samtveloursfutter, einem Block Planblätter und einem Jahreskalender. Er ist jederzeit zu ergänzen mit einem Adress- und Telefonregister.</p>\r\n<p>\r\n<strong>Inhalt:</strong><br/>\r\nEinband aus echtem Rindleder mit edlem Samtveloursfutter<br/>\r\nPlanblätter geblockt 25 St. Art.Nr. 8006108<br/>\r\nKalender A6 Art.Nr. 818009<br/>\r\n</p>\r\n<p>\r\n<b>Material:</b> strapazierbares Leder<br>\r\n<b>Farbe:</b> schwarz<br>\r\n<b>Format:</b> DIN A6<br>\r\n</p>',	'<p>für Aufzeichnungen, Notizen und Ideen unterwegs. Inklusive Kalender und Planblätter.</p>\r\n<p>\r\n<strong>Inhalt:</strong><br/>\r\nEinband aus echtem Rindleder mit edlem Samtveloursfutter<br/>\r\nPlanblätter geblockt 25 St. Art.Nr. 8006108<br/>\r\nKalender A6 Art.Nr. 818009<br/>\r\n</p>\r\n<p>\r\n<strong>Material:</strong> strapazierbares Leder<br>\r\n<strong>Format: </strong> DIN A6<br>\r\n<strong>Farbe:</strong> schwarz\r\n</p>',	'466070-Planer-Leder-schwarz'),
