(358,	'584470',	'9553a3875acc4705806266e0d957e0ec',	'584470 Planständer aus Acrylglas',	'[{\"name\": \"584470\", \"type\": \"jpg\"}, {\"name\": \"584470_02\", \"type\": \"jpg\"}, {\"name\": \"910000_03\", \"type\": \"jpg\"}]',	79,	0,	NULL,	117,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:12',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n<span style=\"font-size:20px;color: #000000;\">So einfach funktioniert ZPM:</span>\r\n</p>\r\n<div class=\"responsive-video\">\r\n<iframe src=\"https://player.vimeo.com/video/32567030?title=0&amp;byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff&amp;autoplay=0\" width=\"500\" height=\"281\" frameborder=\"0\" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe></div> <p>In diesem Video zeigen wir wie einfach es ist, alle Termine im &Uuml;berblick zu behalten. Alle. Immer.</p><p>Der Planständer nimmt mit den 3 Fächern, dile seitlich offen sind, bis zu 6 Plantafeln auf und ist mit zusätzlichem Mappenfach ausgestattet</p>\r\n<p>\r\n<strong>Material:</strong> Acrylglas<br/>\r\n<strong>Farbe:</strong> transparent<br/>\r\n<strong>Stärke:</strong> 4 mm<br/>\r\n<strong>Breite:</strong> 310 mm<br/>\r\n<strong>Höhe:</strong> 170 mm<br/>\r\n<strong>Tiefe:</strong> 165 mm\r\n</p>',	'<p>Der Planständer nimmt mit den 3 Fächern, die seitlich offen sind, bis zu 6 Plantafeln auf und ist mit zusätzlichem Mappenfach ausgestattet</p>\r\n<p>\r\n<strong>Material:</strong> Acrylglas<br/>\r\n<strong>Farbe:</strong> transparent<br/>\r\n<strong>Stärke:</strong> 4 mm<br/>\r\n<strong>Breite:</strong> 310 mm<br/>\r\n<strong>Höhe:</strong> 170 mm<br/>\r\n<strong>Tiefe:</strong> 165 mm\r\n</p>',	'584470-Planstaender-aus-Acrylglas'),
