(390,	'605000',	'8f7290a6a9cf4d679821f71fb5954c50',	'605000 Schutz-Tabs, Bogen=15 Stck.',	'[{\"name\": \"605000\", \"type\": \"jpg\"}, {\"name\": \"605000_02\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schutz-tabs\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	2.1,	0,	1.85,	4046,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:26',	20,	'haben mehrere Funktionen:<br>a) die selbstklebende Klarsichtfolie schützt und verstärkt den Quick-Tab<br>b) bildet zusammen mit dem Tab-Strip (Schildchen) den Strip-Tab<br>c) ergibt einen 15 mm hohen weissen Folien-Tab, wenn der mittlere Teil beschriftet und mit der Folie überklebt wird <br><br><b>Material:</b> selbstklebende Klarsichtfolie<br><b>Breite:</b> 58 mm<br><b>Tabs pro Bogen:</b> 15<br>',	'Schutzfolie für Quick-Tabs, Art. 58 10 .. und haben zusätzlich mehrere Funktionen',	'605000-Schutz-Tabs-Bogen-15-Stck'),
(391,	'626026',	'f9dbc9b94f2c4e4b8616a21f71d85af5',	'626026 Plantafel Kunststoff weiß',	'[{\"name\": \"626026\", \"type\": \"jpg\"}, {\"name\": \"626026_02\", \"type\": \"jpg\"}, {\"name\": \"910000_02\", \"type\": \"jpg\"}, {\"name\": \"910000\", \"type\": \"jpg\"}]',	14.65,	0,	NULL,	400,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:27',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n<span style=\"font-size:20px;color: #000000;\">So einfach funktioniert ZPM:</span>\r\n</p><div class=\"responsive-video\">\r\n<iframe src=\"https://player.vimeo.com/video/32567030?title=0&amp;byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff&amp;autoplay=0\" width=\"500\" height=\"281\" frameborder=\"0\" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe></div> <p></p> <p>In diesem Video zeigen wir wie einfach es ist, alle Termine im &Uuml;berblick zu behalten. Alle. Immer.</p>\r\nnimmt die Plankarten und Planblätter auf, wobei diese schuppenförmig angeordnet werden<br><br>Mit dem selbstklebenden Fenster-Reiter (ArtNr. 410251) können die einzelnen Plantafeln gekennzeichnet werden, wie z.B. Tagesplan, Projekt XY, Wichtig usw.\r\n<p>\r\n<b>Material:</b> Kunststoff<br>\r\n<b>Breite: </b> 315 mm<br>\r\n<b>Höhe: </b> 225 mm<br>\r\n<b>Farbe:</b> weiß\r\n</p>',	'<p>\r\nNimmt die Plankarten und Planblätter auf, wobei diese schuppenförmig angeordnet werden. Lieferung ohne Fensterreiter.\r\n</p>\r\n<p>\r\n<b>Material:</b> Kunststoff<br>\r\n<b>Breite: </b> 315 mm<br>\r\n<b>Höhe: </b> 225 mm<br>\r\n<b>Farbe:</b> weiß\r\n</p>',	'626026-Plantafel-Kunststoff-weiss'),
(392,	'700004S',	'd579583a87514621bf851cdabc431ad2',	'700004S Big-Tabs Sortiment(Farben 00-04)',	'[{\"name\": \"700004s\", \"type\": \"jpg\"}, {\"name\": \"beispiel_big-tabs\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schreibtisch\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	14.25,	0,	NULL,	4,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:27',	20,	'<p>sind große, selbstklebende Beschriftungsreiter (Set, 5 Bögen) aus stabilem Haftkarton</p><p>Diese Tabs sind 15 mm hoch und 70 mm breit. Dadurch stehen 81% mehr Beschriftungsfläche zur Verfügung gegenüber dem normalen Quick-Tab. Durch das handliche DIN A4 Format sind sie mit den meisten Druckern zu beschriften.</p><p>Vorteile:<br/> <ul><li>größere Beschriftungsfläche - plus 81%</li><li>teilbar in 4 kleine Einzeldruckformate (für Drucker)</li><li> bis zu 3 Zeilen beschriftbar</li><li>handliches DIN A4 Format</li><li>in 10 Farben erhältlich</li></ul></p><p>Tipp: Mischen Sie nicht unterschiedlich hohe Orga-Tabs (z.B Quick Tabs + Big Tabs) an Orga-Mappen innerhalb einer Orga-Box, da die höheren Tabs die niedrigen Tabs verdecken.</p><p>Extra Tipp: Der Big-Tab ist auch bestens geeignet für Leitkartenunterteilung (rechts außen angeklebt), da der höhere Tab Unterteilungen besser und schneller erkennen lässt.</p><p>Verwendung für Namen und Begriffe</p><p>     <a href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\" target=\"_blank\">         <strong>NEU Online-Druck:</strong> kostenlos und ohne Installation     </a> </p><p><strong>Material:</strong> Haftkarton 250 g/m²<br/><strong>Farben:</strong> weiß, gelb, rot, blau und orange<br/><strong>Breite:</strong> 70 mm<br/><strong>Höhe:</strong> 15 mm<br/><strong>Tabs pro Bogen:</strong> 12</p>',	'<p>sind große, selbstklebende Beschriftungsreiter (Set, 5 Bögen) aus stabilem Haftkarton</p><p>     <a href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\" target=\"_blank\">   