(404,	'705000',	'42896dfb2c884e5dacfa6996996cde47',	'705000 Schutz-Tabs, Bogen=8 Stck.',	'[{\"name\": \"705000\", \"type\": \"jpg\"}, {\"name\": \"705000_02\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schutz-tabs\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	2.5,	0,	NULL,	428,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:32',	20,	'haben mehrere Funktionen:<br>a) die selbstklebende Klarsichtfolie schützt und verstärkt den Big-Tab<br>b) oder ergibt einen 12 mm hohen weissen Folien-Tab, wenn der mittlere Teil beschriftet und mit der Folie überklebt wird <br><br><b>Material:</b> selbstklebende Klarsichtfolie<br><b>Breite:</b> 70 mm<br><b>Tabs pro Bogen:</b> 8<br>',	'Schutzfolie für Big-Tabs, Art. 70 10 .. und haben zusätzlich mehrere Funktionen',	'705000-Schutz-Tabs-Bogen-8-Stck'),
(405,	'710503',	'07d56108d1ee4a059b1709f9d1dadcee',	'710503 Classata-Schrank 60, 3-bahnig, 5 Schübe',	'[{\"name\": \"710503\", \"type\": \"jpg\"}, {\"name\": \"710503_02\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	1899,	0,	NULL,	0,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:32',	20,	'<p>\r\n<strong>Direkter Zugriff</strong><br />\r\nMit einer Schubladenbewegung haben Sie den Inhalt von 15 Orgaboxen im sofortigen Zugriff.\r\n</p>\r\n<p>\r\n<strong>Optimale Funktionalität</strong><br />\r\nDurch die geringe Höhe von 139 cm ist die Bedienung der obersten Schublade kein Problem. Mühelos erreichen Sie die hinterste Akte. Zentralverriegelung und Einzelschubsperre für absolute Kippsicherheit.\r\n</p>\r\n<p>\r\n<strong>Maximale Raumnutzung</strong><br />\r\nSie erhöhen nicht nur die Arbeitsproduktivität, sondern nutzen auch Büroraum und Schrankvolumen in optimaler Form, da nur eine Standfläche von 0,66 m<sup>2</sup> nötig ist.\r\n</p>\r\n<p>\r\n<strong>Praktisch und handlich</strong><br />\r\nEinfache Handhabung nach ergonomischen Standpunkten, gewährleisten Ihnen leichtlaufende Qualitätsstahlkugellager, Teleskopschienen mit\r\n100%-Überauszug mit 110kg Tragkraft pro Schub und handgerechte Chrombügel.\r\n</p>\r\n<p>\r\n<strong>Hochwertiges Material</strong><br />\r\nHochwertiges Stahlmaterial und perfekte Verarbeitung verleihen dem Schrank zeitlose Eleganz.\r\n<p>\r\n<p>\r\n<strong>Maße:</strong><br />\r\nBreite: 1100 mm<br />\r\nTiefe: 602 mm</br>\r\nHöhe: 1390 mm</br>\r\nGewicht: 165 kg\r\n</p>\r\n</p><p><strong>Garantie:</strong> 2 Jahre<br>(Technische/optische Änderungen vorbehalten - Lieferung ohne Inhalt - Schrank ist nicht zerlegbar)\r\n<br>Lieferung: Stückgut-Spedition (vor die erste absperrbare Türe ebenerdig mit Sückgutspediteur - 1 Mann)\r\n<br> Lieferung frei Verwendungsstelle auf Anfrage\r\n\r\n\r\n</p><p>Dieser Artikel wird kundenspezifisch gefertigt und ist deshalb vom Umtausch ausgeschloßen.</p>',	'<p>\r\n<b>Farbe:</b> lichtgrau\r\n<br><b>Anzahl Bahnen pro Schub:</b> 3\r\n<br><b>Anzahl Schübe:</b> 5\r\n<br><b>Kapazität:</b> 75 Classei Orga-Boxen\r\n<br><b>Leergewicht:</b> 169 kg\r\n</p>',	'710503-Classata-Schrank-60-3-bahnig-5-Schuebe'),
(406,	'730503',	'3387c425406848fcb52a92f455463334',	'730503 Classata-Schrank 47, 3-bahnig, 5 Schübe',	'[{\"name\": \"730503\", \"type\": \"jpg\"}, {\"name\": \"730503_02\", \"type\": \"jpg\"}, {\"name\": \"beispiel_schrank_schublade\", \"type\": \"jpg\"}]',	1399,	0,	NULL,	0,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:33',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n    <span style=\"font-size:20px;color: #000000;\">Der Classata Schrank:</span>\r\n</p>\r\n<div class=\"responsive-video\">\r\n    <iframe src=\"https://player.vimeo.com/video/241517278?title=0&amp;byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff&amp;autoplay=0\" width=\"500\" height=\"281\" frameborder=\"0\" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe>\r\n</div> <p></p> <p>In diesem Video zeigen wir Ihnen die Vorteile dieses massiven aber schmalen Schrankes.</p>\r\n<p>Der Schrank bietet viel Platz auf kleinster Fläche mit optimalem Aktenzugriff.</p><p>Mit einer Tiefe von nur 499 mm\r\n    ist dieser Schrank hervorragend geeignet für Home-Offices, kleine Büros und schmale Gänge. Hochwertiger Stahl und\r\n    perfekte, ergonomische Verarbeitung geben dem Schrank zeitlose Eleganz. Leicht laufende Stahlkugellager und\r\n    Teleskopschienen mit 100 % Überauszug gewährleisten einfache Handhabung. Ein Zentralverschluß mit 2 Schlüssel rundet\r\n    die Handhabung und Sicherheit ab.</p>\r\n<p>\r\n    <strong>Farbe:</strong> lichtgrau<br>\r\n    <strong>Anzahl Bahnen pro Schub:</strong> 3<br>\r\n    <strong>Anzahl Schübe:</strong> 5<br>\r\n    <strong>Kapazität:</strong> 60 Classei Orga-Boxen<br>\r\n    <strong>Leergewicht:</strong> 159 kg\r\n</p>\r\n<p>\r\n    <strong><u>Maße außen:</u></strong> <br>\r\n    <strong>Breite:</strong> 1083 mm<br>\r\n    <strong>Höhe:</strong> 1425 mm<br>\r\n    <strong>Tiefe:</strong> 499 mm\r\n</p>\r\n<p>\r\n    <strong>lichte Schubhöhe:</strong> 250 mm\r\n</p>\r\n<p>\r\n    <strong>Garantie:</strong> 5 Jahre<br>\r\n   (Technische/optische Änderungen vorbehalten - Lieferung ohne Inhalt - Schrank ist nicht zerlegbar)<br>\r\n    Lieferung: Stückgut-Spedition (vor die erste absperrbare Türe ebenerdig mit Stückgut-Spediteur - 1 Mann)<br>\r\n    Lieferung frei Verwendungsstelle auf Anfrage\r\n</p>\r\n<p>Dieser Artikel wird kundenspezifisch gefertigt und ist deshalb vom Umtausch ausgeschloßen.</p>',	'<p>Hochwertiges Stahlmaterial und perfekte, ergonomische Verarbeitung geben dem Schrank mit Zentralverschluß zeitlose Eleganz. Leicht laufende Kugellager und Teleskopschienen mit Überauszug gewährleisten einfache Handhabung. </p><p><b>Artikelnummer: </b>730503<br><b>Farbe: </b>lichtgrau</p>',	'730503-Classata-Schrank-47-3-bahnig-5-Schuebe'),
(407,	'7510',	'005d72958ca34cb4af251f10260304e7',	'7510 Classei-Mobil, lichtgrau',	'[{\"name\": \"7510\", \"type\": \"jpg\"}, {\"name\": \"7510S\", \"type\": \"jpg\"}, {\"name\": \"beispiel_7510_mit_tisch\", \"type\": \"jpg\"}]',	189,	0,	NULL,	26,	NULL,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:33',	20,	'<p>bringt Mobilität ins Büro<br><br>Das Classei-Mobil kann bis zu 12 Orga-Boxen fassen: 6 Boxen mit optimalem Direkt-Zugriff von oben, 6 Boxen auf der zweiten Ebene (Fachhöhe: 27 cm).  Ideal als Beistell-/Unterstell-Wagen für Schreibtische ohne Unterbau. <br><br><b><u>Maße:</u></b><br><b>Breite:</b> 708 mm | <b>Tiefe:</b> 400 mm<b> | Höhe:</b> 640 mm<br><b>Gewicht:</b> 18,5 kg<br><br><b>Material:</b> kunststoffbeschichtete Spanplatten<br><b>Lieferung:</b> leichter Selbstmontage-Satz</p>',	'<p>Das Classei-Mobil kann bis zu 12 Orga-Boxen fassen: 6 Boxen mit optimalem Direkt-Zugriff von oben, 6 Boxen auf der zweiten Ebene. Durch die leichtgängigen Rollen und die kompakten Ausmaße ist es sehr flexibel und an jedem Arbeitsplatz einsetzbar.</p>\r\n<p><strong>Maße:</strong><br /><strong>Breite:</strong> 708 mm<br /><strong>Tiefe:</strong> 400 mm<br /><strong>Höhe:</strong> 640 mm<br /><strong>Gewicht:</strong> 18,5 kg<br /><strong>Material:</strong> kunststoffbeschichtete Spanplatten</p>\r\n<p><strong>Lieferung: </strong>Leichter Selbstmontage-Satz</strong></p>',	'7510-Classei-Mobil-lichtgrau'),
(408,	'7510S',	'2458ba59ffcc494a9bcfe42d5441a368',	'7510S Classei-Mobil mit Orgamittel',	'[{\"name\": \"7510S\", \"type\": \"jpg\"}, {\"name\": \"7510\", \"type\": \"jpg\"}, {\"name\": \"beispiel_7510_mit_tisch\", \"type\": \"jpg\"}]',	389,	0,	NULL,	0,	NULL,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:33',	20,	'<p>bringt Mobilität ins Büro<br><br>Das Classei-Mobil kann bis zu 12 Orga-Boxen fassen: 6 Boxen mit optimalem Direkt-Zugriff von oben, 6 Boxen auf der zweiten Ebene (Fachhöhe: 27 cm). Durch die leichtgängigen Rollen und die kompakten Ausmaße ist es sehr flexibel und an jedem Arbeitsplatz einsetzbar. Ideal als Beistell-/Unterstell-Wagen für Schreibtische ohne Unterbau. <br><br><b>Maße: </b><br<b>Breite:</b> 708 mm | <b>Tiefe:</b> 400 mm<b> | Höhe:</b> 640 mm<br><b>Gewicht:</b> 27,7 kg<br><br><b>Material:</b> kunststoffbeschichtete Spanplatten<br><b>Lieferung:</b> leichter Selbstmontage-Satz<br><br>mit folgenden Classei-Organisationsmitteln:<br>6 Stk. Orga-Boxen, lichtgrau, ArtNr. 104014<br>250 Stk. Orga-Mappen, hellgelb ArtNr. 204113<br>je 2 Blatt Quick-Tabs, ArtNr. 581000-04<br>(weiß, gelb, rot, blau, orange)<br>1 Folienschreiber, sw, ArtNr. 450313</p>',	'<p>Das Classei-Mobil kann bis zu 12 Orga-Boxen fassen: 6 Boxen mit optimalem Direkt-Zugriff von oben, 6 Boxen auf der zweiten Ebene.</p>\r\n<p>Inklusive folgender Classei-Organisationsmittel:<br />\r\n6 Stk. Orga-Boxen lichtgrau<br />\r\n250 Stk. Orga-Mappen, hg<br />\r\nje 2 Blatt Quick-Tabs, 5 Farben<br />\r\n1 Folienschreiber, sw</p>\r\n<p><strong>Maße:</strong><br /><strong>Breite:</strong> 708 mm<br /><strong>Tiefe:</strong> 400 mm<br /><strong>Höhe:</strong> 640 mm<br /><strong>Gewicht:</strong> 27,7 kg<br /><strong>Material:</strong> kunststoffbeschichtete Spanplatten</p>\r\n<p><strong>Lieferung: </strong>Leichter Selbstmontage-Satz</strong></p>',	'7510S-Classei-Mobil-mit-Orgamittel'),
(409,	'7703',	'3369c30c03dc4d008e372f8617c8deb0',	'7703 Classei-Auszug, lichtgrau',	'[{\"name\": \"7703\", \"type\": \"jpg\"}, {\"name\": \"7703_02\", \"type\": \"jpg\"}, {\"name\": \"7703_03\", \"type\": \"jpg\"}, {\"name\": \"7703_04\", \"type\": \"jpg\"}]',	89,	0,	NULL,	83,	NULL,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:34',	20,	'<p>Praktischer Auszug - für alle Möbel geeignet<br />Der Classei-Auszug kann bis zu 3 Orga-Boxen fassen. Problemlos auf Fachböden in Schränken und Regalen zu montieren. Der <strong>Überauszug</strong> ist ideal um mehr Orgaboxen hintereinander zu verstauen, ohne auf die Zugänglichkeit achten zu müssen. Je nach Fachbodenbreite können mehrere Auszüge nebeneinander montiert werden.</p><p><strong>Maße:</strong><br /><strong>Tiefe:</strong> 350 mm<br /><strong>Breite:</strong> 360 mm<br /><strong>Material:</strong> Kunststoffbeschichtete Spanplatten<br /><strong>Belastung:</strong> max. 20 kg<br /><strong>Fachbodenmindesthöhe:</strong> 275 mm<br /><strong>Lieferung:</strong> Fertig montiert</p>',	'<p>Praktischer Auszug, für alle Möbel geeignet! Der Classei-Auszug kann bis zu 3 Orga-Boxen fassen. Problemlos auf Fachböden in Schränken und Regalen - auch nebeneinander - zu montieren. Der Überauszug ist ideal um mehr Orgaboxen hintereinander zu verstauen, ohne auf die Zugänglichkeit achten zu müssen.</p>\r\n<p><strong>Tiefe:</strong> 350 mm<br />\r\n<strong>Breite:</strong> 360 mm<br />\r\n<strong>Material:</strong> Kunststoffbeschichtete Spanplatten<br /></p>\r\n<p><strong>Lieferung: </strong>Fertig montiert</strong></p>',	'7703-Classei-Auszug-lichtgrau'),
