(444,	'910000',	'80f88e6023d2411c88b063204428affa',	'910000 Schreibtisch-Set (ZPM)',	'[{\"name\": \"910000\", \"type\": \"jpg\"}, {\"name\": \"910000_02\", \"type\": \"jpg\"}, {\"name\": \"910000_03\", \"type\": \"jpg\"}]',	124.95,	0,	NULL,	0,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:48',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n<span style=\"font-size:20px;color: #000000;\">So einfach funktioniert ZPM:</span>\r\n</p><div class=\"responsive-video\">\r\n<iframe src=\"https://player.vimeo.com/video/32567030?title=0&amp;byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff&amp;autoplay=0\" width=\"500\" height=\"281\" frameborder=\"0\" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe></div> <p></p> <p>In diesem Video zeigen wir wie einfach es ist, alle Aufgaben und Termine permanent im &Uuml;berblick zu behalten. Mit dem Set sofort startklar.<br><br>Das Schreibtisch-Set beinhaltet:</b><br>1 Acrylglas-Planständer mit Mappenfach (ArtNr. 584470)<br>3 Plantafeln (ArtNr. 626026) mit Fenster-Reiter (Tages-, Wochen-, Monatsplan),<br>diese können jederzeit ausgetauscht und mit individuellen Begriffen, wie z.B. Projekt 1,2,3 verwendet werden<br>1 Acrylglas-Blattständer (ArtNr. 586170) mit 100 Planblätter (ArtNr. 806008)',	'<p>\r\nAlle Termine und Projekte im Überblick halten.\r\n</p>\r\n<p>\r\n<strong>Das Schreibtisch-Set beinhaltet:</strong>\r\n<br>1 Acrylglas-Planständer (ArtNr. 584470)\r\n<br>3 Plantafeln (ArtNr. 626026) mit Fenster-Reiter (Tages-, Wochen-, Monatsplan)\r\n<br>1 Blattständer (ArtNr. 586170) mit <br/>\r\n100 Planblätter (ArtNr. 806008)\r\n</p>',	'910000-Schreibtisch-Set-ZPM'),
