(450,	'E10000',	'84f6d9b21c3a403ba7f5fa3cfcf2dcef',	'E10000 Easy-Binding-Set',	'[{\"name\": \"e10000\", \"type\": \"jpg\"}, {\"name\": \"e10000_02\", \"type\": \"jpg\"}, {\"name\": \"e10000_03\", \"type\": \"jpg\"}, {\"name\": \"e10000_04\", \"type\": \"jpg\"}]',	131.65,	0,	NULL,	5,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:51',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n<span style=\"font-size:20px;color: #000000;\">So einfach funktioniert Easy-Binding:</span>\r\n</p><div class=\"responsive-video\">\r\n\r\n<iframe src=\"https://player.vimeo.com/video/56743453?title=0&amp;byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff&amp;autoplay=0\" width=\"500\" height=\"281\" frameborder=\"0\" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe></div>\r\n<p>Dieses Video zeigt Ihnen, wie Sie einfach, sauber und schnell Blattstapel durch Klebung zusammenbinden</p>\r\nDas neue Bindesystem Easy-Bindung bietet eine schnelle und einfache Möglichkeit, lose Blätter in Form von Blattstapeln, e-Books, Listen, Berichten, Benutzungshandbücher, Akten, Vorgängen, usw. durch Klebung zusammenzubinden. \r\n\r\n<br><br>Das Set beinhaltet:</b>\r\n<br><br>Easy-Binding\r\n<br>1 Easy Binding Vorrichtung E1 10 00\r\n<br>1 Andruck Winkel E1 20 00\r\n<br>10 Einlegeplatten E1 02 00\r\n<br>2 Klebestifte E1 02 01\r\n<br>1 Anleitung Easy Binding\r\n<br><br>Classei Orgamittel Set:\r\n<br>1 Orga Box 10 40 14\r\n<br>1 Rückenschild 40 41 00\r\n<br>1 Sichttasche 44 20 50\r\n<br>20 Orga Mappen 20 41 16\r\n<br>5 Orga Mappen 20 41 23\r\n<br>5 Orga Dehnmappen 21 41 23\r\n<br>2 Orga Dehnmappen 21 41 40\r\n<br>5 Elegance Mappen 20 40 45/00 06\r\n<br>1 Orga Tabs 58 10 00\r\n<br>1 Orga Tabs 58 10 01\r\n<br>1 Folienschreiber 45 03 13\r\n<br>1 Mappenstütze 57 43 70\r\n<br>1 Classei Infomappe\r\n<br>1 Anleitung  10 Schritte',	'<p><strong>Das Set beinhaltet:</strong><br />\r\n1 Easy Binding Vorrichtung E1 10 00<br />\r\n1 Andruck Winkel E1 20 00<br />\r\n10 Einlegeplatten E1 02 00<br />\r\n2 Klebestifte E1 02 01<br />\r\n1 Anleitung Easy Binding\r\n</p>\r\n<p><strong>Classei Orgamittel Set:</strong><br />\r\n1 Orga Box 10 40 14<br />\r\n1 Rückenschild 40 41 00<br />\r\n1 Sichttasche 44 20 50<br />\r\n20 Orga Mappen 20 41 16<br />\r\n5 Orga Mappen 20 41 23<br />\r\n5 Orga Dehnmappen 21 41 23<br />\r\n2 Orga Dehnmappen 21 41 40<br />\r\n5 Elegance Mappen 20 40 45/00 06<br />\r\n1 Orga Tabs 58 10 00<br />\r\n1 Orga Tabs 58 10 01<br />\r\n1 Folienschreiber 45 03 13<br />\r\n1 Mappenstütze 57 43 70<br />\r\n1 Classei Infomappe<br />\r\n1 Anleitung  10 Schritte<br />\r\n</p>',	'E10000-Easy-Binding-Set'),
(451,	'E10201',	'55c7a60a10bb4d37a1cc1850004f098a',	'E10201 Easy-Binding-Klebestift, 50 ml',	'[{\"name\": \"e10201\", \"type\": \"jpg\"}]',	3.65,	0,	NULL,	117,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:13:51',	20,	'<p id=\"video\" style=\" padding:10px;background-color:#f3f3f3\">\r\n<span style=\"font-size:20px;color: #000000;\">So einfach funktioniert Easy-Binding:</span>\r\n</p><div class=\"responsive-video\">\r\n<iframe src=\"https://player.vimeo.com/video/56743453?title=0&amp;byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff&amp;autoplay=0\" width=\"500\" height=\"281\" frameborder=\"0\" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe></div>\r\n<p>\r\nDer Klebestift hat zwei Auftragsdüsen, eine spitze Düse für dünne Blattstapel und eine große Düse für höhere Blattstapel. Zuerst muss die unter dem Sieb liegende Sicherungskappe bei der großen Düse entfernt werden.</p>',	'<p>\r\nDer Klebestift hat zwei Auftragsdüsen, eine spitze Düse für dünne Blattstapel und eine große Düse für höhere Blattstapel.</p>',	'E10201-Easy-Binding-Klebestift-50-ml');

