(1,	1,	'5a737e54335240cb89c4a1278d8e4196',	11,	'ba79dd5ad2b54aabb525a7ce7ca42874',	'Orga-Mappen',	NULL,	'<table>\r\n    <tbody><tr>\r\n      <td style=\"vertical-align:top\">nehmen Ihre Dokumente sicher auf. Für normale Vorgänge empfehlen wir Standardmappen ab 130 g/qm</td>\r\n      </tr>\r\n      <tr>\r\n      <td style=\"vertical-align:top\" class=\"video\"> <iframe width=\"500\" height=\"282\" frameborder=\"0\" src=\"https://player.vimeo.com/video/152174584?autoplay=0&color=ff9933&title=0&byline=0&portrait=0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" ></iframe></td>\r\n    </tr>\r\n  </tbody></table>',	'2022-03-15 09:24:55',	'2023-02-16 16:10:16'),
(2,	2,	'2cf4827ad8134102b482229650d1c2f6',	11,	'ba79dd5ad2b54aabb525a7ce7ca42874',	'Orga-Tabs',	NULL,	'<table>\r\n    <tbody><tr>\r\n      <td style=\"vertical-align:top\">kennzeichnen Ihre Orga-Mappen klar und eindeutig. Für Standardbeschriftung empfehlen wir Quick-Tabs</td>\r\n      </tr>\r\n      <tr>\r\n      <td style=\"vertical-align:top\" class=\"video\"> <iframe width=\"500\" height=\"282\" frameborder=\"0\" src=\"https://player.vimeo.com/video/152159824?autoplay=0&color=ff9933&title=0&byline=0&portrait=0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" ></iframe></td>\r\n    </tr>\r\n  </tbody></table>',	'2021-12-06 10:57:31',	'2023-02-16 16:10:16'),
(3,	3,	'47742235aebc4f349b5ba86a57f4d8c0',	11,	'ba79dd5ad2b54aabb525a7ce7ca42874',	'Orga-Boxen',	NULL,	'<table>\r\n    <tbody><tr>\r\n      <td style=\"vertical-align:top\">dienen zum systematischen Einstellen oder Archivieren der Orga-Mappen.</td>\r\n      </tr>\r\n      <tr>\r\n      <td style=\"vertical-align:top\" class=\"video\"> <iframe width=\"500\" height=\"282\" frameborder=\"0\" src=\"https://player.vimeo.com/video/158880261?autoplay=0&color=ff9933&title=0&byline=0&portrait=0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" ></iframe></td>\r\n    </tr>\r\n  </tbody></table>',	'2021-12-06 10:57:31',	'2023-02-16 16:10:16'),
(4,	4,	'3b18cd037dc14bc99460abb25e685c12',	11,	'ba79dd5ad2b54aabb525a7ce7ca42874',	'Zubehör',	NULL,	'wird großer Vielfalt und mit hohem Nutzen angeboten. ',	'2021-12-06 10:57:31',	'2023-02-16 16:10:16'),
(5,	5,	'c70bd1df46b24a82b47166730bae1845',	11,	'ba79dd5ad2b54aabb525a7ce7ca42874',	'Fertig-Sets',	NULL,	'Sie enthalten alles, um mit der Classei-Schnellordnung sofort beginnen zu können.',	'2021-12-06 10:57:31',	'2023-02-16 16:10:16'),
(6,	6,	'f26518ba47c8434c9c48106d4a973bec',	11,	'ba79dd5ad2b54aabb525a7ce7ca42874',	'ZPM-System',	NULL,	'verwaltet alle Aufgaben, Planungen und Aktivitäten mit direktem Blick am Schreibtisch.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(7,	7,	'956f7f876baf43d5b4ee4fa3b1765f56',	11,	'ba79dd5ad2b54aabb525a7ce7ca42874',	'Orga-Möbel',	NULL,	'sind speziell für das Classei-System entwickelt worden und extrem platzsparend. ',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(8,	9,	'de8082adf1d343b4afee95eec2c8a2e1',	11,	'ba79dd5ad2b54aabb525a7ce7ca42874',	'Easy Binding',	NULL,	'<p>Easy-Binding bietet eine schnelle und einfache Möglichkeit, lose Blätter durch Klebung zusammen-zubinden. </p>',	'2022-09-06 15:42:50',	'2023-02-16 16:10:16'),
(9,	11,	'ba79dd5ad2b54aabb525a7ce7ca42874',	0,	'0',	'Deutsch',	NULL,	'',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(10,	110,	'e2f18bf14dd54320952d73a0af868dde',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Standard-Mappen',	NULL,	'<p>sind schon wirtschaftlich bei wenigen Schriftstücken. Dicke Akten sind der Feind effizienter Organisation. Vermeiden Sie Sammelakten. Classei-Mappen sind ideal um Vorgänge klein und übersichtlich zu halten. Für normale Vorgänge empfehlen wir Mappen ab 130 g/qm</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(11,	111,	'45e6fb09609f44278dab4199e1f9a2c6',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Elegance-Mappen',	NULL,	'<p>folierter und starker Karton - dadurch besonders reißfest und stabil. In 5 Farben erhältlich und mit Einsteckschlitze für Visitenkarten versehen, daher auch gut geeignet als Angebots-, Präsentations- und Info-Mappen.</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(12,	112,	'2d82c19d025d453996097dd81394e802',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Recycling-Mappen',	NULL,	'<p>aus Recycling-Papier</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(13,	113,	'eef460662fc74a639e64bb66d0ee2c1e',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Dehn-Mappen',	NULL,	'<p>starker Karton und mit einer Dehnfalte ausgestattet, damit sie mit dem Inhalt wachsen kann. Sie fasst bis zu 200 Blatt Papier, daher ideal für starke Vorgänge oder Broschüren und Kataloge.\r\n</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(14,	114,	'66ea73a76ba74b169ce0ce249b4a6ca9',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Klarsicht-Kombi-Mappen',	NULL,	'<p>Die Vorderseite ist mit einer zweiseitig offenen Klarsichthülle ausgestattet. Datenblätter in Klarsichthüllen sind so vom Mappeninhalt getrennt und geschützt. Alle wichtigen Daten sind direkt sichtbar. Die Datenblätter sind leicht austauschbar. Bei Mappen ohne Hülle kann ein Datenblatt eingeklebt werden.</p',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(15,	115,	'10aff8dc77174eceaaf836af4a41ee23',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Multifach-Mappen',	NULL,	'<p>starker Karton mit Innenfächern zur Unterteilung des Schriftguts. Das hintere Innenfach hat zusätzlich eine Dehnfalte für wachsenden Inhalt. Sie sind hervorragend geeignet z.B. für Personal-, Vertrags-, Versicherungsakten und dergleichen. Jedes Innenfach ist mit Seitenklappen, wie bei Standardmappen, ausgestattet und somit kann nichts rausfallen. Die Innenfächer können einzeln mit Tabs gekennzeichnet werden.</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(16,	116,	'dae63382ca49464cac02c5c85c1e4e5a',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Multifunktions-Mappen',	NULL,	'<p>aus starker, transluzenter Kunststofffolie (PP). An einer integrierten Schiebeleiste befindet sich ein Fenster-Reiter, der sich leicht auf neue Positionen verschieben läßt. Sie kann so mehrfach verwendet werden. Für die Einsteckschildchen wird der Tab-Stripbogen (ArtNr. 6010..) in zehn Farben (00-09) verwendet. Packung: 10 Mappen mit aufgesetztem Schieberreiter und einem Tab-Stripbogen. Bitte gewünschte Farb-Nr. bei der Bestellung angeben.</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(17,	117,	'86d536a540b84c2a9f6e53fcca6c5f93',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Klarsicht-Mappen',	NULL,	'<p>aus starker, transparenter Kunststofffolie, Ausführung wie Standardmappen mit Orga-Leiste und Seitenklappen, ähnlich wie Multifunktions-Mappen.</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(18,	118,	'40bc00b236f841a2a839eb43c254bbfe',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Heft-Mappen',	NULL,	'<p>aus starkem Karton und mit Metallheftzunge oder mit Zwischen-Heftvorrichtung ausgestattet zum leichteren Dazu- und Zwischenheften von Schriftstücken - ohne Seitenklappen. Der Inhalt lässt sich bei Zwischen-Heftvorrichtungen flach aufschlagen wie ein Buch.</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(19,	119,	'b97998ea67c34d84893dda9d183936fd',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Dehn-Sammler',	NULL,	'<p>zum Zusammenfassen von Orga-Mappen oder Katalogen, Broschüren oder voluminösem Ablagegut. Er ist mit wachsendem Volumen zu erweitern, bis zu 60mm Stärke des Inhalts. Ausgerüstet mit einer Zwischenheftvorrichtung wird er zum Dehn-Hefter, der zu heftendes Schriftgut aufnimmt und das Dazu- und Zwischenheften erleichtert. Der Inhalt lässt sich flach aufschlagen wie ein Buch.</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(20,	120,	'3efbe15caa5b49be882e19a95c063019',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Dehn-Hefter',	NULL,	'<p>wie Dehn-Sammler (ArtNr. 134050) mit einer Zwischenheftvorrichtung, die das Dazu- und Zwischenheften von Schriftstücken erleichtert. Er lässt sich flach aufschlagen wie ein Buch. Fassungsvermögen bis zu 50 mm.</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(21,	121,	'73bdbf6dd2b444bcaa7b1b874e1b42f6',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Sichtmappen',	NULL,	'<p>aus transparenter Folie. In diesen Sicht-Mappen und - Hüllen können Sie den Inhalt lesen bearbeiten und blättern, ohne ihn entnehmen zu müssen. Durch schnell angebrachte vor allem wiederablösbare Quick-Strips kann sie mehrfach verwendet werden. Ideal geeignet für kurzfristige oder schwebende Vorgänge</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(22,	122,	'8b8df02b8a4a4a9cab0f04e43dd8411c',	1,	'5a737e54335240cb89c4a1278d8e4196',	'Sonderdruck-Mappen',	NULL,	'',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(23,	210,	'aa736883a0684e65acee15d62294681e',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Quick-Tabs',	NULL,	'<p>selbstklebende Beschriftungsreiter aus stabilem Haftkarton (250 g/m²), auf den meisten Laser- und Tintenstrahl-Druckern zu bedrucken. Verfügbare Farben 00-12 und 15-21.</p>\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=143&amp;type=thumb\" /> Die richtige Tab-Druckvorlage f&uuml;r die verschiedenen Tab-B&ouml;gen k&ouml;nnen Sie auf dieser Seite ausw&auml;hlen. Einfach in Word &ouml;ffnen und loslegen.</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/category/4-tab-druckvorlagen.html\">Ausw&auml;hlen</a></div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(24,	211,	'0f8a6f75ab734a328bc5feb7547cd14e',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Big-Tabs',	NULL,	'<p>sind große, selbstklebende Beschriftungsreiter aus stabilem Haftkarton. Sie sind 15 mm hoch und 70 mm breit, dadurch stehen 81% mehr Beschriftungsfläche zur Verfügung gegeüber dem normalen Quick-Tab. Durch das handliche DIN A4 Format sind sie mit den meisten Druckern zu beschriften. Verfügbare Farben 00-09,</p>\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><img sty