(25,	212,	'a24017bb0fb8404985b947297dc434f7',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Folien-Tabs',	NULL,	'<p>selbstklebend für schmutzgeschützte Beschriftungen. Das Beschriftungsschildchen wird von einer transparenten Schutzfolie umschlossen. Für fast alle Drucker verwendbar. Verfügbare Farben 00-09.</p><div class=\"block-group\">\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=143&amp;type=thumb\" /> Die richtige Tab-Druckvorlage f&uuml;r die verschiedenen Tab-B&ouml;gen k&ouml;nnen Sie auf dieser Seite ausw&auml;hlen. Einfach in Word &ouml;ffnen und loslegen.</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/category/4-tab-druckvorlagen.html\">Ausw&auml;hlen</a></div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(26,	213,	'89a23b684d8a4c3383007665142fb1d6',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Strip-Tabs',	NULL,	'<div class=\"block-group\">\r\n    <div class=\"span6 block\"><div class=\"panel\">\r\n            <div class=\"panel--body\">\r\n                selbstklebend für schmutzgeschützte Beschriftungen. Das Beschriftungsschildchen wird von einer transparenten Schutzfolie umschlossen. Nicht für alle Drucker verwendbar. Verfügbare Farben 00-09,\r\n            </div>\r\n        </div>\r\n    </div>\r\n   <div class=\"block-group\">\r\n    <div class=\"span6 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\">\r\n                <img src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" style=\"float:left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" />\r\n                Als Überblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.\r\n            </div>\r\n            <div class=\"panel--footer\">\r\n                <a class=\"btn\"  href=\"https://www.classei.de/jdownloads/Systembeschreibungen/classei-farbskala.pdf\">Herunterladen</a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span6 block\"><div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\">\r\n                <img src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=143&amp;type=thumb\" style=\"float:left; margin-right: 10px; margin-bottom: 10px\" alt=\"Die Classei Farbskala\" />\r\n                Die richtige Tab-Druckvorlage für die verschiedenen Tab-Bögen können Sie auf dieser Seite auswählen.\r\n            </div>\r\n            <div class=\"panel-footer\">\r\n                <a class=\"btn\" href=\"https://www.classei.de/service/media-center/downloads/category/4-tab-druckvorlagen.html\">Auswählen</a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(27,	214,	'c0467b9257b74cec91d809cf858e8b62',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Schutz-Tabs',	NULL,	'<p>Die selbstklebende Klarsichtfolie, schützt und verstärkt den Quick-Tab. Empfohlen für Mappen die oft gegriffen werden. Verleiht dem Quick-Tab zusätzlichen Halt und schützt vor Schmutz und Nässe.</p><p> Erhältlich in 4 Größen. </p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(28,	215,	'3e0c5da8c13248ba932427ca39e9a57f',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Signal-Tabs',	NULL,	'<div class=\"block-group\">\r\n    <div class=\"span6 block\"><div class=\"panel\">\r\n            <div class=\"panel--body\">\r\n                für Termin-, Signal-, und Markierungszwecke. Der Tab ist 13mm hoch und überragt damit die meisten Tabs, somit kann nichts übersehen werden. Beispiel: rot = wünscht Bezahlung nur per Kreditkarte. Verfügbare Farben 00-12, \r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span6 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\">\r\n                <img src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" style=\"float:left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" />\r\n                Als Überblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.\r\n            </div>\r\n            <div class=\"panel--footer\">\r\n                <a class=\"btn\"  href=\"https://www.classei.de/jdownloads/Systembeschreibungen/classei-farbskala.pdf\">Herunterladen</a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(29,	216,	'9462af28f0e84945a2085c94216bacae',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Quick-Strips',	NULL,	'<p>sind selbstklebende, wiederablösbare Beschriftungsetiketten aus Haftpapier und speziell für Mappen mit hochstehender Rückwand entwickelt. Sie können rückstandslos wieder abgelöst werden und somit kann die Mappe für neue Vorgänge mehrfach verwendet werden.</p>\r\n<p style=\"color: rgb(255, 102, 51)\"><strong>Hinweis: </strong><br/>Artikel ist nur verwendbar für <strong>Blättersicht-Mappe 224453</strong> und <strong>Klarsicht-Mappe, Art. 204451</strong></p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(30,	217,	'f79d51eee3ef436cbc6672f8bf19c047',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Daten-Tabs',	NULL,	'<div class=\"block-group\">\r\n	<div class=\"span6 block\">\r\n		<div class=\"panel\">\r\n			<div class=\"panel--body\">sind Tabs mit diversen Eindrucken. Verf&uuml;gbare Farben 00-12 und 15-21, siehe unten(bei ArtNr. 0913..A und 0913..N nur 00-09)</div>\r\n			</div>\r\n		</div>\r\n	<div class=\"span6 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\">\r\n                <img src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" style=\"float:left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" />\r\n                Als Überblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.\r\n            </div>\r\n            <div class=\"panel--footer\">\r\n                <a class=\"btn\"  href=\"https://www.classei.de/jdownloads/Systembeschreibungen/classei-farbskala.pdf\">Herunterladen</a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(31,	218,	'89e3f5522063448b8c71e13c8e77e5e5',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Fenster-Reiter',	NULL,	'<p>aus stabiler Klarsichtfolie, mit weißem Beschriftungsschild, auswechselbar; geeignet für Sammler, Dehnsammler, Leitkarten und ZPM-Plantafeln. Entweder selbstklebend oder für Schiebeleiste</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(32,	219,	'9f900f396496417098a3aa990b93297d',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Beschriftungs-Schilder',	NULL,	'<p>für Strip-Tabs und Fensterreiter. Verfügbare Farben 00-09, siehe unten</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(33,	220,	'7c941e2856284d84b10adfeb34c31729',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Tab-Beschriftung',	NULL,	'\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=143&amp;type=thumb\" /> Die richtige Tab-Druckvorlage f&uuml;r die verschiedenen Tab-B&ouml;gen k&ouml;nnen Sie auf dieser Seite ausw&auml;hlen. Einfach in Word &ouml;ffnen und loslegen.</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/category/4-tab-druckvorlagen.html\">Ausw&auml;hlen</a></div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(34,	230,	'844fa2d3cd4146e2af99d5269415fb67',	2,	'2cf4827ad8134102b482229650d1c2f6',	'Tab-Umsetzer',	NULL,	'<p>zum Versetzen der Quick-Tabs z.B. für Terminierung, wechselnde Beschriftung usw. Er wird auf der oberen Randkante der Rückseite der Orga-Mappe angeklebt. Der Tab haftet fest an, lässt sich aber doch langsam lösen.</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(35,	310,	'e296c02338264e8f8c0c4deb22f8d7c4',	3,	'47742235aebc4f349b5ba86a57f4d8c0',	'Kunststoff-Boxen',	NULL,	'aus stabilem Kunststoff; Ineinander steckbar, dadurch fast 50% Platzersparnis im Lager und beim Transport. Eingeclipste Griff-Hängeleisten dienen zur besseren Handhabung der Boxen. In genormten Hängerahmen dienen sie zum Einhängen der Boxen.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(36,	311,	'132e05611f3f459c82329810d789b916',	3,	'47742235aebc4f349b5ba86a57f4d8c0',	'Griff-Hängeleisten',	NULL,	'für Kunststoffboxen. Einzeln in die seitlichen Schlitze der Box eingeclipst, lassen sie sich besser handhaben oder in genormten Hängerahmen abhängen. Zum besseren Herausziehen aus Regalen genügt eine Griffleiste an der Vorderseite. Farbige Leisten, passend zu den Kunststoff-Boxen, auf Anfrage.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(37,	312,	'8e7b1abe52c2497fb655d06f94499cc5',	3,	'47742235aebc4f349b5ba86a57f4d8c0',	'Karton-Boxen',	NULL,	'aus doppelwandigem Karton oder Microwelle. Sie werden flach geliefert und benötigen daher wenig Lagerraum. Im Handumdrehen aufgestellt durch den leicht bedienbaren Schnappverschluß.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(38,	313,	'470bb5dc12b84f25ab0c4b0c0c1820ee',	3,	'47742235aebc4f349b5ba86a57f4d8c0',	'Acrylglas-Boxen',	NULL,	'aus transparentem, dickwandigem Acrylglas. Ein attraktives Accessoire für den Schreibtisch. Mit unterschiedlichen Fülltiefen fassen sie wesentlich mehr Orga-Mappen als normale Boxen. So haben Sie alle aktuellen und wichtigen Vorgänge immer im Blick. Im Gegensatz zu Acryl-Boxen ist der Acryl-Ständer seitlich offen. Darin können lateral (seitlich) bereiterte Orga-Mappen oder größere Formate eingestellt werden.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(39,	314,	'192fd430de3b4b1c99e5d924d63ed064',	3,	'47742235aebc4f349b5ba86a57f4d8c0',	'Lateral-Boxen',	NULL,	'seitlich offen, für lateral (seitlich) bereiterte Orga-Mappen. In Regalen und Schränken untergebracht, bilden sie die Lateralablage. Vorteil: Mappen können direkt eingesehen und gegriffen werden, ohne die Box zu entnehmen. Nachteil: schlechte Unterbringung am Schreibtisch.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(40,	315,	'5e4400a49f7e4c3782a3cf770f1e54d3',	3,	'47742235aebc4f349b5ba86a57f4d8c0',	'Sammler',	NULL,	'<p>haben wie die Boxen ein unveränderliches Füllvermögen. Sie sind vorgesehen für Handakten, zum Zusammenstellen, Gruppieren und Gliedern von Orga-Mappen. Sie werden flach geliefert, sind einfach aufzustellen und passen in alle Orga-Boxen.</p>',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(41,	317,	'f4637dea625b484b9ed2044a7ec6a33c',	3,	'47742235aebc4f349b5ba86a57f4d8c0',	'Archiv-Boxen',	NULL,	'zur Archivierung (Altablage) und staubgeschützten Aufbewahrung von Orga-Mappen oder sonstigem Schriftgut. Die meisten Boxen haben eine verschließbare, leicht zu öffnende Klappe. Sie werden flach geliefert und sind mit wenigen Handgriffen aufgestellt.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(42,	318,	'99e75c9e61cb4497b1986b9c4b0fabe2',	3,	'47742235aebc4f349b5ba86a57f4d8c0',	'Mappenstützen',	NULL,	'zum Abstützen der Orga-Mappen in wenig gefüllten Orga-Boxen. Sie gibt sie federnd nach und kann bei wachsendem Mappen-Inhalt mehrfach in eine neue Box umgesetzt werden.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(43,	319,	'30f4b44db0ca4dcfa694226001cff9fd',	3,	'47742235aebc4f349b5ba86a57f4d8c0',	'Rückenschilder',	NULL,	'zur Kennzeichnung der Orga- und Archivboxen. Sie sind selbstklebend und werden direkt auf die Seiten-(Rücken-) Fläche der Boxen aufgeklebt. Wird die Beschriftung oft geändert, empfiehlt sich, eine selbstklebende Sichttasche (ArtNr. 442050) zu verwenden, in die das Rückenschild (ArtNr. 404100) eingesteckt und ausgewechselt werden kann.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(44,	410,	'f6b1d91f45ab4826a8cb3f593dd62508',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Heftvorrichtungen',	NULL,	'für geheftete Schriftgutablage. Sie sind an beliebiger Stelle in Orga-Mappen, Dehnsammlern, Aktendeckeln und dergleichen einzukleben. Belege können damit verbunden und später in Mappen eingeklebt werden.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(45,	411,	'66d7f84743514964b54279c368a20b75',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Zwischenheftvorrichtungen',	NULL,	'eignen sich besonders zum Dazu- und Zwischenheften von Schriftstücken in Sammelmappen und Dehnsammlern (ArtNr. 134050). Mit Einklebeplatte eignet sich die Heftvorrichtung auch für alle Mappen ab 170 g/m2. Vorteil: Leichtes Zwischenheften und der Inhalt ist flach aufzuschlagen wie ein Buch.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(46,	412,	'5472b586f8e84a37ad3b50209b796c38',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Einklebetaschen',	NULL,	'transparent und selbstklebend, zur raumsparenden Aufbewahrung von BluRays, DVDs, CDs, Visitenkarten oder kleineren Belegen usw.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(47,	413,	'10669d19a12546edb1ecba6b2cbef41c',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Leitkarten',	NULL,	'zum Gliedern, Gruppieren und Unterteilen von Orga-Mappen in Orga-Boxen',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(48,	414,	'c83047ae7bef4bfba50c4de40fd2ff5f',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Tab-Umsetzer',	NULL,	'zum Versetzen der Quick-Tabs z.B. für Terminierung, wechselnde Beschriftung usw. Er wird am oberen Rand der Orga-Mappe angeklebt. Der Tab haftet fest an, lässt sich aber doch langsam lösen.',	'2021-12-06 09:57:32',	'2023-02-16 16:10:16'),
(49,	415,	'a9d2ebaac379470ab6c665d941834d5d',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Einklebeklappen',	NULL,	'sind gefalzte, selbstklebende Klappen. Kleinere Formate, z. B. Kontoauszüge, können im Inneren der Mappe neben- oder untereinander aufbewahrt werden.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(50,	416,	'f58097a8663d4af3a2479c933411e27d',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Trennstreifen',	NULL,	'unterteilen den Mappeninhalt und können wie bei einem Register beschriftet werden.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(51,	417,	'df30e30fcea04cf3baa1f60435675605',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Klarsichtfenster',	NULL,	'mit rückseitiger Selbstklebefläche zur Beschriftung von Regalen, Schränken, Kästen und Tafeln',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(52,	418,	'54a3ed4d8c1a485e9513f6be10935c07',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Entnahmekarten',	NULL,	'mit Quittungsvordruck werden an Stelle der entnommenen Akten eingestellt.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(53,	419,	'ecebf95a62834079a2a05538d89bd9e0',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Handscanner',	NULL,	'Praktischer Handscanner für z.B. unseren Literatur-Organizer.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(54,	420,	'3ee66bac4bbd41519175c2dccd302d9e',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Koffer | Transport',	NULL,	'Ideal für den Transport von Classei-Unterlagen zu Meetings, Vorträgen oder Besprechungen. Alle GO-Boxen und Koffer sind sehr handllch und leicht.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(55,	421,	'a03204cee2d6449d85b52ca0d668d17a',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Literatur',	NULL,	'zum Weiterlesen',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(56,	422,	'4d12ec05d53e47f7ac62d3d479bcfc9f',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Beschriftungs-Schilder',	NULL,	'für Strip-Tabs und Fensterreiter. Verfügbare Farben 00-09, siehe unten',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(57,	423,	'3f44c11d4cab43ac922e72c161948018',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Tab-Beschriftung',	NULL,	'<p>einfach und schnell beschriften. Hinweise zu Beschriftungsmöglichkeiten</p>\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=143&amp;type=thumb\" /> Die richtige Tab-Druckvorlage f&uuml;r die verschiedenen Tab-B&ouml;gen k&ouml;nnen Sie auf dieser Seite ausw&auml;hlen. Einfach in Word &ouml;ffnen und loslegen.</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/category/4-tab-druckvorlagen.html\">Ausw&auml;hlen</a></div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(58,	424,	'de9c72c81a514c79b249d5aaefb85a5a',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Mappenstützen',	NULL,	'dienen zum Abstützen der Orga-Mappen in wenig befüllten Orga-Boxen.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(59,	425,	'7adb5ba732dd426dacf8201d4452cd65',	4,	'3b18cd037dc14bc99460abb25e685c12',	'Sichthüllen',	NULL,	'in diesen Sichthüllen/-mappen können Sie den Inhalt bearbeiten und blättern, ohne ihn entnehmen zu müssen. ',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(60,	510,	'8d9d6b9f8805481380874e92c3307034',	5,	'c70bd1df46b24a82b47166730bae1845',	'Arbeitsplatzorganisation',	NULL,	'Es sind bewährte und sinnvolle Zusammenstellungen. Damit können Sie sofort starten, ohne lange zu überlegen. Zudem haben die Sets auch einen Preisvorteil\r\n<br><span style=\"color:red; font-weight:bold;\">Empfehlungstipp für den Start:</span> Das Business-Set oder Business-Set Pro',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(61,	511,	'2a73e360a7234e9182451edd0cb6123c',	5,	'c70bd1df46b24a82b47166730bae1845',	'Terminverfolgung',	NULL,	'<table width=\"100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width:50%\"><iframe width=\"356\" height=\"200\" frameborder=\"0\" allowfullscreen=\"\" mozallowfullscreen=\"\" webkitallowfullscreen=\"\" src=\"https://player.vimeo.com/video/41014047?byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff\"></iframe></td>\r\n            <td style=\"valign:bottom; width:5%\"></td>\r\n            <td style=\"valign:bottom; width:40%\">\r\n            <h4>Hier finden Sie bew&auml;hrte und sinnvolle Zusammenstellungen. Damit k&ouml;nnen Sie sofort starten, ohne lange zu &uuml;berlegen. <br />\r\n            Zudem haben die Sets auch einen Preisvorteil!</h4>\r\n            </td>\r\n            <td style=\"valign:bottom; width:5%\"></td>\r\n        </tr>\r\n    </tbody>\r\n</table>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(62,	512,	'206f7775431f452885c17e0c46ae7fb5',	5,	'c70bd1df46b24a82b47166730bae1845',	'Orga-Sets',	NULL,	'Es sind bewährte und sinnvolle Zusammenstellungen. Damit können Sie sofort starten, ohne lange zu überlegen. Zudem haben die Sets auch einen Preisvorteil!',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(63,	513,	'814ef56840b04c58af66245203825f7c',	5,	'c70bd1df46b24a82b47166730bae1845',	'Ergänzungs-Sets',	NULL,	'<p>Hier finden Sie eine Auswahl an Ergänzungen für die Terminverfolgung. Wir bieten Ergänzungen in diesen 4 verschiedenen Ausführungen:</p><p>Standard-Mappen <strong>20 41 16</strong><br />Elegance-Mappen <strong>20 40 45/00 weiß</strong><br />Kunsststoff-Mappen <strong>20 44 50</strong><br />Leitkarten <strong>50 40 32</strong></p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(64,	514,	'6b7c3c662e6549869880f93d9ba7333e',	5,	'c70bd1df46b24a82b47166730bae1845',	'White-Edition',	NULL,	'<p><strong>Elegante</strong> und <strong>funktionelle</strong> Organisation für Ihren Arbeitsplatz mit der neuen Serie <strong>White Edition</strong> von Classei. Die fein abgestimmte <strong>weiße Mappenserie</strong> ist für jede Vorgangsart geeignet. Classei bietet die repräsentativen Mappen in drei unterschiedlichen Ausführungen an.</p>\r\n<p>Zudem ist die White-Edition kombiniert mit <strong>attraktiven Acrylglas-Boxen</strong> als fertige Sets erhältlich. Sofort startklar - so macht das Arbeiten mit dem Classei-System rund um den Schreibtisch noch mehr Spaß.</p>\r\n<p>Wir haben für Sie <strong>2 verschiedene Sets</strong> zusammengestellt, welche sich nur durch die enthaltene Acrylglas Box unterscheiden.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(65,	515,	'98f30dc2038948e6967df981ab9131eb',	5,	'c70bd1df46b24a82b47166730bae1845',	'HomeOffice Edition',	NULL,	'',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(66,	517,	'02302f81b73b44beb07c7be0620a11fa',	5,	'c70bd1df46b24a82b47166730bae1845',	'Business Edition',	NULL,	'',	'2021-10-15 13:34:00',	'2023-02-16 16:10:16'),
(67,	610,	'ef6c5d8c3d324be4bf1c5032122f6e83',	6,	'f26518ba47c8434c9c48106d4a973bec',	'Schreibtisch-Set',	NULL,	'enthält alles, um mit der Aufgaben- und Projekt-Planung sofort beginnen zu können. Einfach auf dem Schreibtisch gut sichtbar aufstellen und schon kann es losgehen. Zukünftig haben Sie all Ihre Vorhaben und geplanten Aktivitäten vor Augen. Sie übersehen oder vergessen nichts mehr.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(68,	611,	'f57675bb8d3046a8b4a17a31cf059483',	6,	'f26518ba47c8434c9c48106d4a973bec',	'Plantafeln',	NULL,	'nehmen die Plankarten und Planblätter auf, welche schuppenförmig angeordnet werden. Mit dem selbstklebenden Fensterreiter können die einzelnen Plantafeln gekennzeichnet werden, wie z.B. Tagesplan, Projekt XY oder Wichtig usw.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(69,	612,	'4655e0b385964ff4bdff33f34d0b37d9',	6,	'f26518ba47c8434c9c48106d4a973bec',	'Planständer',	NULL,	'nehmen mit den drei Fächern bis zu sechs Plantafeln auf und sind mit zusätzlichem Mappenfach ausgestattet.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(70,	613,	'afa7018324f245e8a5bdf98ad6c71e27',	6,	'f26518ba47c8434c9c48106d4a973bec',	'Blattständer',	NULL,	'nehmen Blankoplanblätter zur griffbereiten Benutzung auf.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(71,	614,	'4efdb4c9cca84a26b704c96ce9483090',	6,	'f26518ba47c8434c9c48106d4a973bec',	'Planblätter',	NULL,	'zur Aufzeichnung von Aufgaben, Aktivitäten und Ideen. Sie sind alle mit einem Organisationsdruck versehen. Für das normale Tagesgeschehen werden Planblätter 80g/m2 oder Plankarten 170g/m2 verwendet. Für Aufgaben, die sich in ihrer Priorität unterscheiden, werden farbige Planblätter verwendet. Für Team- oder Delegationsarbeit gibt es Planblätter mit Durchschrift.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(72,	615,	'2bb8e60b8246432c835b4668d7c7ec71',	6,	'f26518ba47c8434c9c48106d4a973bec',	'Planer',	NULL,	'für Aufzeichnungen und Notizen unterwegs. Im handlichen DIN A6-Format ist er ausgestattet mit einem Block Planblätter und einem Jahreskalender. Er ist jederzeit zu ergänzen mit einem Adress- und Telefonregister.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(73,	710,	'6b9719c730774540a3336c0d07d37100',	7,	'956f7f876baf43d5b4ee4fa3b1765f56',	'Classata-Schränke Typ 60',	NULL,	'Gehäuse aus 1,25 mm Stahlblech. Voll ausziehbare Schübe auf rostfreien Teleskopschienen mit Überauszug und 110 kg Tragkraft pro Schub. Zentralverriegelung und Einzelschubsperre für absolute Kippsicherheit. Fünf Schübe auf Stahlkugellagerrollen für ruhigen Lauf. Gerundete Ecken für höchste ergonomische Ansprüche. Verchromte Bügelgriffe.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(74,	711,	'dde5316209474939b64958a81b23ac75',	7,	'956f7f876baf43d5b4ee4fa3b1765f56',	'Classata-Schränke Typ 47',	NULL,	'bieten viel Platz auf kleinster Fläche mit optimalem Aktenzugriff. Mit einer Tiefe von nur 50 cm und durchgehender innen liegender Griffleiste sind diese Schränke hervorragend geeignet für das Home-Office, kleine Büros und schmale Gänge.\r\nTiefe: 50 cm, \r\nBoxen pro Schub: 12',	'2022-02-15 09:15:18',	'2023-02-16 16:10:16'),
(75,	712,	'bfdeb33e10024e8b91eb195cbee45aab',	7,	'956f7f876baf43d5b4ee4fa3b1765f56',	'Classei-Mobil',	NULL,	'Mit diesen neuen Rollmöbeln bringt Classei Mobilität ins Büro. Sie fassen insgesamt 12 Orga-Boxen. Durch die leichtgängigen Rollen und die kompakten Ausmaße sind sie sehr flexibel und an jedem Arbeitsplatz einsetzbar.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(76,	713,	'd8cf3634cf1e400f9e9cf8409816b7cb',	7,	'956f7f876baf43d5b4ee4fa3b1765f56',	'Classei-Auszug',	NULL,	'Der Classei-Auszug kann bis zu 3 Orga-Boxen fassen. Problemlos auf Fachböden in Schränken und Regalen zu montieren. Der Überauszug ist Ideal um mehr Orgaboxen hintereinander oder nebeneinander zu verstauen, ohne auf die Zugänglichkeit achten zu müssen.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(77,	10000,	'd302bc78760d43c1ae5b3560f9957414',	0,	'0',	'Schweiz',	NULL,	'',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(78,	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	10000,	'd302bc78760d43c1ae5b3560f9957414',	'Orga-Mappen',	NULL,	'<table>\r\n    <tbody><tr>\r\n      <td style=\"vertical-align:top\">nehmen Ihre Dokumente sicher auf. Für normale Vorgänge empfehlen wir Standardmappen ab 130 g/qm</td>\r\n      </tr>\r\n      <tr>\r\n      <td style=\"vertical-align:top\" class=\"video\"> <iframe width=\"500\" height=\"282\" frameborder=\"0\" src=\"https://player.vimeo.com/video/152174584?autoplay=0&color=ff9933&title=0&byline=0&portrait=0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" ></iframe></td>\r\n    </tr>\r\n  </tbody></table>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(79,	10002,	'97b9706850934ce487b441ebc4c1f645',	10000,	'd302bc78760d43c1ae5b3560f9957414',	'Orga-Tabs',	NULL,	'<table>\r\n    <tbody><tr>\r\n      <td style=\"vertical-align:top\">kennzeichnen Ihre Orga-Mappen klar und eindeutig. Für Standardbeschriftung empfehlen wir Quick-Tabs</td>\r\n      </tr>\r\n      <tr>\r\n      <td style=\"vertical-align:top\" class=\"video\"> <iframe width=\"500\" height=\"282\" frameborder=\"0\" src=\"https://player.vimeo.com/video/152159824?autoplay=0&color=ff9933&title=0&byline=0&portrait=0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" ></iframe></td>\r\n    </tr>\r\n  </tbody></table>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(80,	10003,	'46d5108c2ab44f078ade6dea6e4fbd81',	10000,	'd302bc78760d43c1ae5b3560f9957414',	'Orga-Boxen',	NULL,	'<table>\r\n    <tbody><tr>\r\n      <td style=\"vertical-align:top\">dienen zum systematischen Einstellen oder Archivieren der Orga-Mappen.</td>\r\n      </tr>\r\n      <tr>\r\n      <td style=\"vertical-align:top\" class=\"video\"> <iframe width=\"500\" height=\"282\" frameborder=\"0\" src=\"https://player.vimeo.com/video/158880261?autoplay=0&color=ff9933&title=0&byline=0&portrait=0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" ></iframe></td>\r\n    </tr>\r\n  </tbody></table>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(81,	10004,	'fb6310d535e14b00a74fa26a7c445da3',	10000,	'd302bc78760d43c1ae5b3560f9957414',	'Zubehör',	NULL,	'wird großer Vielfalt und mit hohem Nutzen angeboten. ',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(82,	10005,	'c1d853e373e54cb2bc1af769f096acc8',	10000,	'd302bc78760d43c1ae5b3560f9957414',	'Fertig-Sets',	NULL,	'Sie enthalten alles, um mit der Classei-Schnellordnung sofort beginnen zu können.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(83,	10006,	'1b1e231dbded4d4da22c2d7a7c0554e2',	10000,	'd302bc78760d43c1ae5b3560f9957414',	'ZPM-System',	NULL,	'verwaltet alle Aufgaben, Planungen und Aktivitäten mit direktem Blick am Schreibtisch.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(84,	10007,	'd4961e20340e4e198daf90b67d97987d',	10000,	'd302bc78760d43c1ae5b3560f9957414',	'Orga-Möbel',	NULL,	'sind speziell für das Classei-System entwickelt worden und extrem platzsparend. ',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(85,	10110,	'5ab046a6cb7143b1823cf44857da4575',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Standard-Mappen',	NULL,	'<p>sind schon wirtschaftlich bei wenigen Schriftstücken. Dicke Akten sind der Feind effizienter Organisation. Vermeiden Sie Sammelakten. Classei-Mappen sind ideal um Vorgänge klein und übersichtlich zu halten. Für normale Vorgänge empfehlen wir Mappen ab 130 g/qm</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(86,	10111,	'a0a30bf9a4b54ebeba1a8a7cd624ac5a',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Elegance-Mappen',	NULL,	'<p>folierter und starker Karton - dadurch besonders reißfest und stabil. In 5 Farben erhältlich und mit Einsteckschlitze für Visitenkarten versehen, daher auch gut geeignet als Angebots-, Präsentations- und Info-Mappen.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(87,	10112,	'565b94e0b49c433d868fee9417e2e4da',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Recycling-Mappen',	NULL,	'<p>aus Recycling-Papier</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(88,	10113,	'545e510bc94f4eb387255c4972818ea3',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Dehn-Mappen',	NULL,	'<p>starker Karton und mit einer Dehnfalte ausgestattet, damit sie mit dem Inhalt wachsen kann. Sie fasst bis zu 200 Blatt Papier, daher ideal für starke Vorgänge oder Broschüren und Kataloge.\r\n</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(89,	10114,	'f56693e73acb4d769fed728ccc785b6b',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Klarsicht-Kombi-Mappen',	NULL,	'<p>Die Vorderseite ist mit einer zweiseitig offenen Klarsichthülle ausgestattet. Datenblätter in Klarsichthüllen sind so vom Mappeninhalt getrennt und geschützt. Alle wichtigen Daten sind direkt sichtbar. Die Datenblätter sind leicht austauschbar. Bei Mappen ohne Hülle kann ein Datenblatt eingeklebt werden.</p',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(90,	10115,	'83afd6533c6540db9b2e555883a7e870',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Multifach-Mappen',	NULL,	'<p>starker Karton mit Innenfächern zur Unterteilung des Schriftguts. Das hintere Innenfach hat zusätzlich eine Dehnfalte für wachsenden Inhalt. Sie sind hervorragend geeignet z.B. für Personal-, Vertrags-, Versicherungsakten und dergleichen. Jedes Innenfach ist mit Seitenklappen, wie bei Standardmappen, ausgestattet und somit kann nichts rausfallen. Die Innenfächer können einzeln mit Tabs gekennzeichnet werden.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(91,	10116,	'63ff366265bd460c9d4e4107d44748d8',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Multifunktions-Mappen',	NULL,	'<p>aus starker, transluzenter Kunststofffolie (PP). An einer integrierten Schiebeleiste befindet sich ein Fenster-Reiter, der sich leicht auf neue Positionen verschieben läßt. Sie kann so mehrfach verwendet werden. Für die Einsteckschildchen wird der Tab-Stripbogen (ArtNr. 6010..) in zehn Farben (00-09) verwendet. Packung: 10 Mappen mit aufgesetztem Schieberreiter und einem Tab-Stripbogen. Bitte gewünschte Farb-Nr. bei der Bestellung angeben.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(92,	10117,	'7491dd0d1cbb43fa8c261f37254a1ff1',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Klarsicht-Mappen',	NULL,	'<p>aus starker, transparenter Kunststofffolie, Ausführung wie Standardmappen mit Orga-Leiste und Seitenklappen, ähnlich wie Multifunktions-Mappen.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(93,	10118,	'e41f493d09c54c34b70d0e081102c9e3',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Heft-Mappen',	NULL,	'<p>aus starkem Karton und mit Metallheftzunge oder mit Zwischen-Heftvorrichtung ausgestattet zum leichteren Dazu- und Zwischenheften von Schriftstücken - ohne Seitenklappen. Der Inhalt lässt sich bei Zwischen-Heftvorrichtungen flach aufschlagen wie ein Buch.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(94,	10119,	'd59f877530814d11a05d826cf1295b0b',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Dehn-Sammler',	NULL,	'<p>zum Zusammenfassen von Orga-Mappen oder Katalogen, Broschüren oder voluminösem Ablagegut. Er ist mit wachsendem Volumen zu erweitern, bis zu 60mm Stärke des Inhalts. Ausgerüstet mit einer Zwischenheftvorrichtung wird er zum Dehn-Hefter, der zu heftendes Schriftgut aufnimmt und das Dazu- und Zwischenheften erleichtert. Der Inhalt lässt sich flach aufschlagen wie ein Buch.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(95,	10120,	'2155a02fad414fcab627282d9be0fe43',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Dehn-Hefter',	NULL,	'<p>wie Dehn-Sammler (ArtNr. 134050) mit einer Zwischenheftvorrichtung, die das Dazu- und Zwischenheften von Schriftstücken erleichtert. Er lässt sich flach aufschlagen wie ein Buch. Fassungsvermögen bis zu 50 mm.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(96,	10121,	'ca498ffa6c2a488a9230cb8bc9712ff1',	10001,	'dc6869f8ac5d469584a161b9dd24c8c6',	'Sichtmappen',	NULL,	'<p>aus transparenter Folie. In diesen Sicht-Mappen und - Hüllen können Sie den Inhalt lesen bearbeiten und blättern, ohne ihn entnehmen zu müssen. Durch schnell angebrachte vor allem wiederablösbare Quick-Strips kann sie mehrfach verwendet werden. Ideal geeignet für kurzfristige oder schwebende Vorgänge</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(97,	10210,	'7ba168dc778c440abcc54d24ae526c71',	10002,	'97b9706850934ce487b441ebc4c1f645',	'Quick-Tabs',	NULL,	'<p>selbstklebende Beschriftungsreiter aus stabilem Haftkarton (250 g/m²), auf den meisten Laser- und Tintenstrahl-Druckern zu bedrucken. Verfügbare Farben 00-12 und 15-21.</p>\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=143&amp;type=thumb\" /> Die richtige Tab-Druckvorlage f&uuml;r die verschiedenen Tab-B&ouml;gen k&ouml;nnen Sie auf dieser Seite ausw&auml;hlen. Einfach in Word &ouml;ffnen und loslegen.</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/category/4-tab-druckvorlagen.html\">Ausw&auml;hlen</a></div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(98,	10211,	'c17e6fa166a04bd0b50011d15266062f',	10002,	'97b9706850934ce487b441ebc4c1f645',	'Big-Tabs',	NULL,	'<p>sind große, selbstklebende Beschriftungsreiter aus stabilem Haftkarton. Sie sind 15 mm hoch und 70 mm breit, dadurch stehen 81% mehr Beschriftungsfläche zur Verfügung gegeüber dem normalen Quick-Tab. Durch das handliche DIN A4 Format sind sie mit den meisten Druckern zu beschriften. Verfügbare Farben 00-09,</p>\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><i