(101,	10214,	'c57624154b5746d3918d697fd2632df6',	10002,	'97b9706850934ce487b441ebc4c1f645',	'Schutz-Tabs',	NULL,	'<p>Die selbstklebende Klarsichtfolie, schützt und verstärkt den Quick-Tab. Empfohlen für Mappen die oft gegriffen werden. Verleiht dem Quick-Tab zusätzlichen Halt und schützt vor Schmutz und Nässe.</p><p> Erhältlich in 4 Größen. </p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(102,	10215,	'618c25860ca44d6fb26456e71a616108',	10002,	'97b9706850934ce487b441ebc4c1f645',	'Signal-Tabs',	NULL,	'<div class=\"block-group\">\r\n    <div class=\"span6 block\"><div class=\"panel\">\r\n            <div class=\"panel--body\">\r\n                für Termin-, Signal-, und Markierungszwecke. Der Tab ist 13mm hoch und überragt damit die meisten Tabs, somit kann nichts übersehen werden. Beispiel: rot = wünscht Bezahlung nur per Kreditkarte. Verfügbare Farben 00-12, \r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span6 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\">\r\n                <img src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" style=\"float:left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" />\r\n                Als Überblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.\r\n            </div>\r\n            <div class=\"panel--footer\">\r\n                <a class=\"btn\"  href=\"https://www.classei.de/jdownloads/Systembeschreibungen/classei-farbskala.pdf\">Herunterladen</a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(103,	10216,	'd095410611624495978e51931fbab4a3',	10002,	'97b9706850934ce487b441ebc4c1f645',	'Quick-Strips',	NULL,	'<p>sind selbstklebende, wiederablösbare Beschriftungsetiketten aus Haftpapier und speziell für Mappen mit hochstehender Rückwand entwickelt. Sie können rückstandslos wieder abgelöst werden und somit kann die Mappe für neue Vorgänge mehrfach verwendet werden.</p>\r\n<p><strong>Hinweis: </strong><br/>Artikel ist nur verwendbar für <strong>Blättersicht-Mappe 224453</strong> und <strong>Klarsicht-Mappe, Art. 204451</strong></p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(104,	10217,	'd588fc326c594740b47a8cef670131a2',	10002,	'97b9706850934ce487b441ebc4c1f645',	'Daten-Tabs',	NULL,	'<div class=\"block-group\">\r\n	<div class=\"span6 block\">\r\n		<div class=\"panel\">\r\n			<div class=\"panel--body\">sind Tabs mit diversen Eindrucken. Verf&uuml;gbare Farben 00-12 und 15-21, siehe unten(bei ArtNr. 0913..A und 0913..N nur 00-09)</div>\r\n			</div>\r\n		</div>\r\n	<div class=\"span6 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\">\r\n                <img src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" style=\"float:left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" />\r\n                Als Überblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.\r\n            </div>\r\n            <div class=\"panel--footer\">\r\n                <a class=\"btn\"  href=\"https://www.classei.de/jdownloads/Systembeschreibungen/classei-farbskala.pdf\">Herunterladen</a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(105,	10218,	'4f132ef3671c43cbb0434ddb3bea8009',	10002,	'97b9706850934ce487b441ebc4c1f645',	'Fenster-Reiter',	NULL,	'<p>aus stabiler Klarsichtfolie, mit weißem Beschriftungsschild, auswechselbar; geeignet für Sammler, Dehnsammler, Leitkarten und ZPM-Plantafeln. Entweder selbstklebend oder für Schiebeleiste</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(106,	10219,	'6a05a5c0663747078e19a65798e7860b',	10002,	'97b9706850934ce487b441ebc4c1f645',	'Beschriftungs-Schilder',	NULL,	'<p>für Strip-Tabs und Fensterreiter. Verfügbare Farben 00-09, siehe unten</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
