e auf dieser Seite ausw&auml;hlen. Einfach in Word &ouml;ffnen und loslegen.</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/category/4-tab-druckvorlagen.html\">Ausw&auml;hlen</a></div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(108,	10230,	'45cb03dc5b65488ea58ff8e35f1b4b5c',	10002,	'97b9706850934ce487b441ebc4c1f645',	'Tab-Umsetzer',	NULL,	'<p>zum Versetzen der Quick-Tabs z.B. für Terminierung, wechselnde Beschriftung usw. Er wird auf der oberen Randkante der Rückseite der Orga-Mappe angeklebt. Der Tab haftet fest an, lässt sich aber doch langsam lösen.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(109,	10310,	'9a430c19ca744d20b591453a0e271b86',	10003,	'46d5108c2ab44f078ade6dea6e4fbd81',	'Kunststoff-Boxen',	NULL,	'aus stabilem Kunststoff; Ineinander steckbar, dadurch fast 50% Platzersparnis im Lager und beim Transport. Eingeclipste Griff-Hängeleisten dienen zur besseren Handhabung der Boxen. In genormten Hängerahmen dienen sie zum Einhängen der Boxen.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(110,	10311,	'24e47ecf6f6140259574fbbcd2f2d7b5',	10003,	'46d5108c2ab44f078ade6dea6e4fbd81',	'Griff-Hängeleisten',	NULL,	'für Kunststoffboxen. Einzeln in die seitlichen Schlitze der Box eingeclipst, lassen sie sich besser handhaben oder in genormten Hängerahmen abhängen. Zum besseren Herausziehen aus Regalen genügt eine Griffleiste an der Vorderseite. Farbige Leisten, passend zu den Kunststoff-Boxen, auf Anfrage.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(111,	10312,	'd136870cc2924a19b7a788440f350399',	10003,	'46d5108c2ab44f078ade6dea6e4fbd81',	'Karton-Boxen',	NULL,	'aus doppelwandigem Karton oder Microwelle. Sie werden flach geliefert und benötigen daher wenig Lagerraum. Im Handumdrehen aufgestellt durch den leicht bedienbaren Schnappverschluß.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(112,	10313,	'fa8c9244756b40e3b3c379d44e001bfe',	10003,	'46d5108c2ab44f078ade6dea6e4fbd81',	'Acrylglas-Boxen',	NULL,	'aus transparentem, dickwandigem Acrylglas. Ein attraktives Accessoire für den Schreibtisch. Mit unterschiedlichen Fülltiefen fassen sie wesentlich mehr Orga-Mappen als normale Boxen. So haben Sie alle aktuellen und wichtigen Vorgänge immer im Blick. Im Gegensatz zu Acryl-Boxen ist der Acryl-Ständer seitlich offen. Darin können lateral (seitlich) bereiterte Orga-Mappen oder größere Formate eingestellt werden.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(113,	10315,	'fd7faabbd33448a0a0dc6fa9d410d64a',	10003,	'46d5108c2ab44f078ade6dea6e4fbd81',	'Sammler',	NULL,	'<p>haben wie die Boxen ein unveränderliches Füllvermögen. Sie sind vorgesehen für Handakten, zum Zusammenstellen, Gruppieren und Gliedern von Orga-Mappen. Sie werden flach geliefert, sind einfach aufzustellen und passen in alle Orga-Boxen.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(114,	10317,	'cdda5f99ddda4433aeaf53a384fc9532',	10003,	'46d5108c2ab44f078ade6dea6e4fbd81',	'Archiv-Boxen',	NULL,	'zur Archivierung (Altablage) und staubgeschützten Aufbewahrung von Orga-Mappen oder sonstigem Schriftgut. Die meisten Boxen haben eine verschließbare, leicht zu öffnende Klappe. Sie werden flach geliefert und sind mit wenigen Handgriffen aufgestellt.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(115,	10318,	'58ac6fae960b4ea686e6f448281ee617',	10003,	'46d5108c2ab44f078ade6dea6e4fbd81',	'Mappenstützen',	NULL,	'zum Abstützen der Orga-Mappen in wenig gefüllten Orga-Boxen. Sie gibt sie federnd nach und kann bei wachsendem Mappen-Inhalt mehrfach in eine neue Box umgesetzt werden.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(116,	10319,	'84e4c0a6631143d780a5283ddf97f9fe',	10003,	'46d5108c2ab44f078ade6dea6e4fbd81',	'Rückenschilder',	NULL,	'zur Kennzeichnung der Orga- und Archivboxen. Sie sind selbstklebend und werden direkt auf die Seiten-(Rücken-) Fläche der Boxen aufgeklebt. Wird die Beschriftung oft geändert, empfiehlt sich, eine selbstklebende Sichttasche (ArtNr. 442050) zu verwenden, in die das Rückenschild (ArtNr. 404100) eingesteckt und ausgewechselt werden kann.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(117,	10410,	'dd9fa5c21aeb4161bf6bf5dd90b7140c',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Heftvorrichtungen',	NULL,	'für geheftete Schriftgutablage. Sie sind an beliebiger Stelle in Orga-Mappen, Dehnsammlern, Aktendeckeln und dergleichen einzukleben. Belege können damit verbunden und später in Mappen eingeklebt werden.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(118,	10411,	'dd8e656dfdf140b5bb685a0a1ce5a149',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Zwischenheftvorrichtungen',	NULL,	'eignen sich besonders zum Dazu- und Zwischenheften von Schriftstücken in Sammelmappen und Dehnsammlern (ArtNr. 134050). Mit Einklebeplatte eignet sich die Heftvorrichtung auch für alle Mappen ab 170 g/m2. Vorteil: Leichtes Zwischenheften und der Inhalt ist flach aufzuschlagen wie ein Buch.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(119,	10412,	'5892bbe229ac471893b73f073fca1c36',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Einklebetaschen',	NULL,	'transparent und selbstklebend, zur raumsparenden Aufbewahrung von BluRays, DVDs, CDs, Visitenkarten oder kleineren Belegen usw.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(120,	10413,	'afcb4349c332430db8cc46d5802f5d5d',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Leitkarten',	NULL,	'zum Gliedern, Gruppieren und Unterteilen von Orga-Mappen in Orga-Boxen',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(121,	10414,	'd3e3966d7a804429b160cf12bed39d0a',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Tab-Umsetzer',	NULL,	'zum Versetzen der Quick-Tabs z.B. für Terminierung, wechselnde Beschriftung usw. Er wird am oberen Rand der Orga-Mappe angeklebt. Der Tab haftet fest an, lässt sich aber doch langsam lösen.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(122,	10418,	'66c6b19d4239442b9cd1c22acb7c9e37',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Entnahmekarten',	NULL,	'mit Quittungsvordruck werden an Stelle der entnommenen Akten eingestellt.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(123,	10420,	'bd2e9cf12a6a46e4a7dfb68311fbd0ff',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Koffer | Transport',	NULL,	'Ideal für den Transport von Classei-Unterlagen zu Meetings, Vorträgen oder Besprechungen. Alle GO-Boxen und Koffer sind sehr handllch und leicht.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(124,	10421,	'996a5b426cd14cff9ed5f9ff19d940c4',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Literatur',	NULL,	'zum Weiterlesen',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(125,	10422,	'b5e2ab65d8694d3589d5123ea82c713d',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Beschriftungs-Schilder',	NULL,	'für Strip-Tabs und Fensterreiter. Verfügbare Farben 00-09, siehe unten',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(126,	10423,	'3e311408514d4d5492fb2c629d81291c',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Tab-Beschriftung',	NULL,	'<p>einfach und schnell beschriften. Hinweise zu Beschriftungsmöglichkeiten</p>\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=143&amp;type=thumb\" /> Die richtige Tab-Druckvorlage f&uuml;r die verschiedenen Tab-B&ouml;gen k&ouml;nnen Sie auf dieser Seite ausw&auml;hlen. Einfach in Word &ouml;ffnen und loslegen.</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/category/4-tab-druckvorlagen.html\">Ausw&auml;hlen</a></div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(127,	10424,	'0ab8288ed5bc4995b5c125db3b9206df',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Mappenstützen',	NULL,	'dienen zum Abstützen der Orga-Mappen in wenig befüllten Orga-Boxen.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(128,	10425,	'1d5c9ef88891487c9c7407cb235446f4',	10004,	'fb6310d535e14b00a74fa26a7c445da3',	'Sichthüllen',	NULL,	'in diesen Sichthüllen/-mappen können Sie den Inhalt bearbeiten und blättern, ohne ihn entnehmen zu müssen. ',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(129,	10510,	'2812eb9f268546b1913475af136d1ebc',	10005,	'c1d853e373e54cb2bc1af769f096acc8',	'Arbeitsplatzorganisation',	NULL,	'Es sind bewährte und sinnvolle Zusammenstellungen. Damit können Sie sofort starten, ohne lange zu überlegen. Zudem haben die Sets auch einen Preisvorteil\r\n<br><span style=\"color:red; font-weight:bold;\">Empfehlungstipp für den Start:</span> Das Business-Set oder Business-Set Pro',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(130,	10511,	'7af71eb1b9554c97a547fb9e12244e36',	10005,	'c1d853e373e54cb2bc1af769f096acc8',	'Terminverfolgung',	NULL,	'<table width=\"100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width:50%\"><iframe width=\"356\" height=\"200\" frameborder=\"0\" allowfullscreen=\"\" mozallowfullscreen=\"\" webkitallowfullscreen=\"\" src=\"https://player.vimeo.com/video/41014047?byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff\"></iframe></td>\r\n            <td style=\"valign:bottom; width:5%\"></td>\r\n            <td style=\"valign:bottom; width:40%\">\r\n            <h4>Hier finden Sie bew&auml;hrte und sinnvolle Zusammenstellungen. Damit k&ouml;nnen Sie sofort starten, ohne lange zu &uuml;berlegen. <br />\r\n            Zudem haben die Sets auch einen Preisvorteil!</h4>\r\n            </td>\r\n            <td style=\"valign:bottom; width:5%\"></td>\r\n        </tr>\r\n    </tbody>\r\n</table>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(131,	10512,	'3e323669b8f54ce884518944cf0003d9',	10005,	'c1d853e373e54cb2bc1af769f096acc8',	'Orga-Sets',	NULL,	'Es sind bewährte und sinnvolle Zusammenstellungen. Damit können Sie sofort starten, ohne lange zu überlegen. Zudem haben die Sets auch einen Preisvorteil!',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(132,	10513,	'91100f626d44458f87b61390e29bad96',	10005,	'c1d853e373e54cb2bc1af769f096acc8',	'Ergänzungs-Sets',	NULL,	'<p>Hier finden Sie eine Auswahl an Ergänzungen für die Terminverfolgung. Wir bieten Ergänzungen in diesen 4 verschiedenen Ausführungen:</p><p>Standard-Mappen <strong>20 41 16</strong><br />Elegance-Mappen <strong>20 40 45/00 weiß</strong><br />Kunsststoff-Mappen <strong>20 44 50</strong><br />Leitkarten <strong>50 40 32</strong></p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(133,	10514,	'dac2f73b13224671b9249abead55ad7c',	10005,	'c1d853e373e54cb2bc1af769f096acc8',	'White-Edition',	NULL,	'<p><strong>Elegante</strong> und <strong>funktionelle</strong> Organisation für Ihren Arbeitsplatz mit der neuen Serie <strong>White Edition</strong> von Classei. Die fein abgestimmte <strong>weiße Mappenserie</strong> ist für jede Vorgangsart geeignet. Classei bietet die repräsentativen Mappen in drei unterschiedlichen Ausführungen an.</p>\r\n<p>Zudem ist die White-Edition kombiniert mit <strong>attraktiven Acrylglas-Boxen</strong> als fertige Sets erhältlich. Sofort startklar - so macht das Arbeiten mit dem Classei-System rund um den Schreibtisch noch mehr Spaß.</p>\r\n<p>Wir haben für Sie <strong>2 verschiedene Sets</strong> zusammengestellt, welche sich nur durch die enthaltene Acrylglas Box unterscheiden.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(134,	10515,	'9533ea50c50c4003ab7147e7efb9bf18',	10005,	'c1d853e373e54cb2bc1af769f096acc8',	'HomeOffice Edition',	NULL,	'',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(135,	10610,	'831c57553a8b40d9b06b10c8079305cd',	10006,	'1b1e231dbded4d4da22c2d7a7c0554e2',	'Schreibtisch-Set',	NULL,	'enthält alles, um mit der Aufgaben- und Projekt-Planung sofort beginnen zu können. Einfach auf dem Schreibtisch gut sichtbar aufstellen und schon kann es losgehen. Zukünftig haben Sie all Ihre Vorhaben und geplanten Aktivitäten vor Augen. Sie übersehen oder vergessen nichts mehr.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(136,	10611,	'1b5fe37ad2b74ed88b5944bf4d213234',	10006,	'1b1e231dbded4d4da22c2d7a7c0554e2',	'Plantafeln',	NULL,	'nehmen die Plankarten und Planblätter auf, welche schuppenförmig angeordnet werden. Mit dem selbstklebenden Fensterreiter können die einzelnen Plantafeln gekennzeichnet werden, wie z.B. Tagesplan, Projekt XY oder Wichtig usw.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(137,	10612,	'2eaff9f411ce49a1bd409719a7b28619',	10006,	'1b1e231dbded4d4da22c2d7a7c0554e2',	'Planständer',	NULL,	'nehmen mit den drei Fächern bis zu sechs Plantafeln auf und sind mit zusätzlichem Mappenfach ausgestattet.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(138,	10613,	'5a87009fd3db4aa89467d02bd1d98034',	10006,	'1b1e231dbded4d4da22c2d7a7c0554e2',	'Blattständer',	NULL,	'nehmen Blankoplanblätter zur griffbereiten Benutzung auf.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(139,	10614,	'b4db25ad9a6d4dd1ae7ab6c98297b32a',	10006,	'1b1e231dbded4d4da22c2d7a7c0554e2',	'Planblätter',	NULL,	'zur Aufzeichnung von Aufgaben, Aktivitäten und Ideen. Sie sind alle mit einem Organisationsdruck versehen. Für das normale Tagesgeschehen werden Planblätter 80g/m2 oder Plankarten 170g/m2 verwendet. Für Aufgaben, die sich in ihrer Priorität unterscheiden, werden farbige Planblätter verwendet. Für Team- oder Delegationsarbeit gibt es Planblätter mit Durchschrift.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(140,	10615,	'33ad7add20094292b421144c131d0fc3',	10006,	'1b1e231dbded4d4da22c2d7a7c0554e2',	'Planer',	NULL,	'für Aufzeichnungen und Notizen unterwegs. Im handlichen DIN A6-Format ist er ausgestattet mit einem Block Planblätter und einem Jahreskalender. Er ist jederzeit zu ergänzen mit einem Adress- und Telefonregister.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(141,	10712,	'0c07c5ca030d41399254ff6acf3688d8',	10007,	'd4961e20340e4e198daf90b67d97987d',	'Classei-Mobil',	NULL,	'Mit diesen neuen Rollmöbeln bringt Classei Mobilität ins Büro. Sie fassen insgesamt 12 Orga-Boxen. Durch die leichtgängigen Rollen und die kompakten Ausmaße sind sie sehr flexibel und an jedem Arbeitsplatz einsetzbar.',	'2022-10-04 13:35:06',	'2023-02-16 16:10:16'),
(142,	10713,	'a720636cb6bb421db2dcf3f59095a663',	10007,	'd4961e20340e4e198daf90b67d97987d',	'Classei-Auszug',	NULL,	'Der Classei-Auszug kann bis zu 3 Orga-Boxen fassen. Problemlos auf Fachböden in Schränken und Regalen zu montieren. Der Überauszug ist Ideal um mehr Orgaboxen hintereinander oder nebeneinander zu verstauen, ohne auf die Zugänglichkeit achten zu müssen.',	'2022-10-04 13:35:06',	'2023-02-16 16:10:16'),
(143,	20000,	'f593c85b46454cd883dc02edbb998837',	0,	'0',	'Italien',	NULL,	'',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(144,	20001,	'282b6d74ccfb480e914e66380886a50d',	20000,	'f593c85b46454cd883dc02edbb998837',	'Orga-Mappen',	NULL,	'<table>\r\n    <tbody><tr>\r\n      <td style=\"vertical-align:top\">nehmen Ihre Dokumente sicher auf. Für normale Vorgänge empfehlen wir Standardmappen ab 130 g/qm</td>\r\n      </tr>\r\n      <tr>\r\n      <td style=\"vertical-align:top\" class=\"video\"> <iframe width=\"500\" height=\"282\" frameborder=\"0\" src=\"https://player.vimeo.com/video/152174584?autoplay=0&color=ff9933&title=0&byline=0&portrait=0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" ></iframe></td>\r\n    </tr>\r\n  </tbody></table>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(145,	20002,	'331e0fce65814bf090c004b4d4ba6416',	20000,	'f593c85b46454cd883dc02edbb998837',	'Orga-Tabs',	NULL,	'<table>\r\n    <tbody><tr>\r\n      <td style=\"vertical-align:top\">kennzeichnen Ihre Orga-Mappen klar und eindeutig. Für Standardbeschriftung empfehlen wir Quick-Tabs</td>\r\n      </tr>\r\n      <tr>\r\n      <td style=\"vertical-align:top\" class=\"video\"> <iframe width=\"500\" height=\"282\" frameborder=\"0\" src=\"https://player.vimeo.com/video/152159824?autoplay=0&color=ff9933&title=0&byline=0&portrait=0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" ></iframe></td>\r\n    </tr>\r\n  </tbody></table>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(146,	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	20000,	'f593c85b46454cd883dc02edbb998837',	'Orga-Boxen',	NULL,	'<table>\r\n    <tbody><tr>\r\n      <td style=\"vertical-align:top\">dienen zum systematischen Einstellen oder Archivieren der Orga-Mappen.</td>\r\n      </tr>\r\n      <tr>\r\n      <td style=\"vertical-align:top\" class=\"video\"> <iframe width=\"500\" height=\"282\" frameborder=\"0\" src=\"https://player.vimeo.com/video/158880261?autoplay=0&color=ff9933&title=0&byline=0&portrait=0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" ></iframe></td>\r\n    </tr>\r\n  </tbody></table>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(147,	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	20000,	'f593c85b46454cd883dc02edbb998837',	'Zubehör',	NULL,	'wird großer Vielfalt und mit hohem Nutzen angeboten. ',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(148,	20005,	'23729f8632b74d759f6157006a8cdc02',	20000,	'f593c85b46454cd883dc02edbb998837',	'Fertig-Sets',	NULL,	'Sie enthalten alles, um mit der Classei-Schnellordnung sofort beginnen zu können.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(149,	20006,	'cff45e70ad11403c9a907cdc2d48ce2d',	20000,	'f593c85b46454cd883dc02edbb998837',	'ZPM-System',	NULL,	'verwaltet alle Aufgaben, Planungen und Aktivitäten mit direktem Blick am Schreibtisch.',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(150,	20007,	'5bca2aa3873d41558ad747af52cc2e91',	20000,	'f593c85b46454cd883dc02edbb998837',	'Orga-Möbel',	NULL,	'sind speziell für das Classei-System entwickelt worden und extrem platzsparend. ',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(151,	20009,	'7e5f027780e047f189b276c25a35ab45',	20000,	'f593c85b46454cd883dc02edbb998837',	'Easy Binding',	NULL,	'<p>Easy-Binding bietet eine schnelle und einfache Möglichkeit, lose Blätter durch Klebung zusammen zubinden.</p>',	'2022-09-01 15:07:45',	'2023-02-16 16:10:16'),
(152,	20110,	'fc254f7484dd479083bf4df22076924c',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Standard-Mappen',	NULL,	'<p>sind schon wirtschaftlich bei wenigen Schriftstücken. Dicke Akten sind der Feind effizienter Organisation. Vermeiden Sie Sammelakten. Classei-Mappen sind ideal um Vorgänge klein und übersichtlich zu halten. Für normale Vorgänge empfehlen wir Mappen ab 130 g/qm</p>',	'2022-09-01 17:07:29',	'2023-02-16 16:10:16'),
(153,	20111,	'af56582210f449ac8529c35b34602d1d',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Elegance-Mappen',	NULL,	'<p>folierter und starker Karton - dadurch besonders reißfest und stabil. In 5 Farben erhältlich und mit Einsteckschlitze für Visitenkarten versehen, daher auch gut geeignet als Angebots-, Präsentations- und Info-Mappen.</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(154,	20112,	'a145cd1520cf425988791de6b16f42e0',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Recycling-Mappen',	NULL,	'<p>aus Recycling-Papier</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(155,	20113,	'232ea2bce6334f848dba1f1a005b0fed',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Dehn-Mappen',	NULL,	'<p>starker Karton und mit einer Dehnfalte ausgestattet, damit sie mit dem Inhalt wachsen kann. Sie fasst bis zu 200 Blatt Papier, daher ideal für starke Vorgänge oder Broschüren und Kataloge.\r\n</p>',	'2021-12-06 10:57:32',	'2023-02-16 16:10:16'),
(156,	20114,	'ff8f75a507334de0aaa8a22ac778b437',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Klarsicht-Kombi-Mappen',	NULL,	'<p>Die Vorderseite ist mit einer zweiseitig offenen Klarsichthülle ausgestattet. Datenblätter in Klarsichthüllen sind so vom Mappeninhalt getrennt und geschützt. Alle wichtigen Daten sind direkt sichtbar. Die Datenblätter sind leicht austauschbar. Bei Mappen ohne Hülle kann ein Datenblatt eingeklebt werden.</p',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(157,	20115,	'5ded3591f05342079cf240e45d899cd7',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Multifach-Mappen',	NULL,	'<p>starker Karton mit Innenfächern zur Unterteilung des Schriftguts. Das hintere Innenfach hat zusätzlich eine Dehnfalte für wachsenden Inhalt. Sie sind hervorragend geeignet z.B. für Personal-, Vertrags-, Versicherungsakten und dergleichen. Jedes Innenfach ist mit Seitenklappen, wie bei Standardmappen, ausgestattet und somit kann nichts rausfallen. Die Innenfächer können einzeln mit Tabs gekennzeichnet werden.</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(158,	20116,	'e22ab2625aee43ff97ce46e69df7f223',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Multifunktions-Mappen',	NULL,	'<p>aus starker, transluzenter Kunststofffolie (PP). An einer integrierten Schiebeleiste befindet sich ein Fenster-Reiter, der sich leicht auf neue Positionen verschieben läßt. Sie kann so mehrfach verwendet werden. Für die Einsteckschildchen wird der Tab-Stripbogen (ArtNr. 6010..) in zehn Farben (00-09) verwendet. Packung: 10 Mappen mit aufgesetztem Schieberreiter und einem Tab-Stripbogen. Bitte gewünschte Farb-Nr. bei der Bestellung angeben.</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(159,	20117,	'2c443f6b149d464a85f628cfc83c652f',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Klarsicht-Mappen',	NULL,	'<p>aus starker, transparenter Kunststofffolie, Ausführung wie Standardmappen mit Orga-Leiste und Seitenklappen, ähnlich wie Multifunktions-Mappen.</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(160,	20118,	'e71a9a9c8ed24681aae66beddb015a47',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Heft-Mappen',	NULL,	'<p>aus starkem Karton und mit Metallheftzunge oder mit Zwischen-Heftvorrichtung ausgestattet zum leichteren Dazu- und Zwischenheften von Schriftstücken - ohne Seitenklappen. Der Inhalt lässt sich bei Zwischen-Heftvorrichtungen flach aufschlagen wie ein Buch.</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(161,	20119,	'ef667d63a6274c16a826a1e6be98aa65',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Dehn-Sammler',	NULL,	'<p>zum Zusammenfassen von Orga-Mappen oder Katalogen, Broschüren oder voluminösem Ablagegut. Er ist mit wachsendem Volumen zu erweitern, bis zu 60mm Stärke des Inhalts. Ausgerüstet mit einer Zwischenheftvorrichtung wird er zum Dehn-Hefter, der zu heftendes Schriftgut aufnimmt und das Dazu- und Zwischenheften erleichtert. Der Inhalt lässt sich flach aufschlagen wie ein Buch.</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(162,	20120,	'6c074f7faf814d32aa1fd8dcf03a5d0e',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Dehn-Hefter',	NULL,	'<p>wie Dehn-Sammler (ArtNr. 134050) mit einer Zwischenheftvorrichtung, die das Dazu- und Zwischenheften von Schriftstücken erleichtert. Er lässt sich flach aufschlagen wie ein Buch. Fassungsvermögen bis zu 50 mm.</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(163,	20121,	'a0120696a57a485993dd1bc471aa6460',	20001,	'282b6d74ccfb480e914e66380886a50d',	'Sichtmappen',	NULL,	'<p>aus transparenter Folie. In diesen Sicht-Mappen und - Hüllen können Sie den Inhalt lesen bearbeiten und blättern, ohne ihn entnehmen zu müssen. Durch schnell angebrachte vor allem wiederablösbare Quick-Strips kann sie mehrfach verwendet werden. Ideal geeignet für kurzfristige oder schwebende Vorgänge</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(164,	20210,	'df89ce6183254e8995f9dc7556fbd4b2',	20002,	'331e0fce65814bf090c004b4d4ba6416',	'Quick-Tabs',	NULL,	'<p>selbstklebende Beschriftungsreiter aus stabilem Haftkarton (250 g/m²), auf den meisten Laser- und Tintenstrahl-Druckern zu bedrucken. Verfügbare Farben 00-12 und 15-21.</p>\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?o