(165,	20211,	'5c732e3bb5964ebfb915d2823ee3b714',	20002,	'331e0fce65814bf090c004b4d4ba6416',	'Big-Tabs',	NULL,	'<p>sind große, selbstklebende Beschriftungsreiter aus stabilem Haftkarton. Sie sind 15 mm hoch und 70 mm breit, dadurch stehen 81% mehr Beschriftungsfläche zur Verfügung gegeüber dem normalen Quick-Tab. Durch das handliche DIN A4 Format sind sie mit den meisten Druckern zu beschriften. Verfügbare Farben 00-09,</p>\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><