(168,	20214,	'f8022fd9d3044dfdabc4ef34d2d5329f',	20002,	'331e0fce65814bf090c004b4d4ba6416',	'Schutz-Tabs',	NULL,	'<p>Die selbstklebende Klarsichtfolie, schützt und verstärkt den Quick-Tab. Empfohlen für Mappen die oft gegriffen werden. Verleiht dem Quick-Tab zusätzlichen Halt und schützt vor Schmutz und Nässe.</p><p> Erhältlich in 4 Größen. </p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(169,	20215,	'2bc0d898e16443beb52c46f3ad04d7d6',	20002,	'331e0fce65814bf090c004b4d4ba6416',	'Signal-Tabs',	NULL,	'<div class=\"block-group\">\r\n    <div class=\"span6 block\"><div class=\"panel\">\r\n            <div class=\"panel--body\">\r\n                für Termin-, Signal-, und Markierungszwecke. Der Tab ist 13mm hoch und überragt damit die meisten Tabs, somit kann nichts übersehen werden. Beispiel: rot = wünscht Bezahlung nur per Kreditkarte. Verfügbare Farben 00-12, \r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span6 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\">\r\n                <img src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" style=\"float:left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" />\r\n                Als Überblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.\r\n            </div>\r\n            <div class=\"panel--footer\">\r\n                <a class=\"btn\"  href=\"https://www.classei.de/jdownloads/Systembeschreibungen/classei-farbskala.pdf\">Herunterladen</a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(170,	20216,	'eff62e5664e04ff5891c2b6f70885a49',	20002,	'331e0fce65814bf090c004b4d4ba6416',	'Quick-Strips',	NULL,	'<p>sind selbstklebende, wiederablösbare Beschriftungsetiketten aus Haftpapier und speziell für Mappen mit hochstehender Rückwand entwickelt. Sie können rückstandslos wieder abgelöst werden und somit kann die Mappe für neue Vorgänge mehrfach verwendet werden.</p>\r\n<p><strong>Hinweis: </strong><br/>Artikel ist nur verwendbar für <strong>Blättersicht-Mappe 224453</strong> und <strong>Klarsicht-Mappe, Art. 204451</strong></p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
