(173,	20219,	'26bc6aaa5b4d49989612f2ffa89963f1',	20002,	'331e0fce65814bf090c004b4d4ba6416',	'Beschriftungs-Schilder',	NULL,	'<p>für Strip-Tabs und Fensterreiter. Verfügbare Farben 00-09, siehe unten</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
