e auf dieser Seite ausw&auml;hlen. Einfach in Word &ouml;ffnen und loslegen.</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/category/4-tab-druckvorlagen.html\">Ausw&auml;hlen</a></div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(175,	20310,	'e50dcc4dd96d48929e864320ac685061',	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	'Kunststoff-Boxen',	NULL,	'aus stabilem Kunststoff; Ineinander steckbar, dadurch fast 50% Platzersparnis im Lager und beim Transport. Eingeclipste Griff-Hängeleisten dienen zur besseren Handhabung der Boxen. In genormten Hängerahmen dienen sie zum Einhängen der Boxen.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(176,	20311,	'89c9518defdb4631aa94ecc4c261aaa0',	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	'Griff-Hängeleisten',	NULL,	'für Kunststoffboxen. Einzeln in die seitlichen Schlitze der Box eingeclipst, lassen sie sich besser handhaben oder in genormten Hängerahmen abhängen. Zum besseren Herausziehen aus Regalen genügt eine Griffleiste an der Vorderseite. Farbige Leisten, passend zu den Kunststoff-Boxen, auf Anfrage.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(177,	20312,	'51a704c5697a41eca130e66a68b1647b',	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	'Karton-Boxen',	NULL,	'aus doppelwandigem Karton oder Microwelle. Sie werden flach geliefert und benötigen daher wenig Lagerraum. Im Handumdrehen aufgestellt durch den leicht bedienbaren Schnappverschluß.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(178,	20313,	'24f4f2a5035e4acb92b05e8802f2d68b',	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	'Acrylglas-Boxen',	NULL,	'aus transparentem, dickwandigem Acrylglas. Ein attraktives Accessoire für den Schreibtisch. Mit unterschiedlichen Fülltiefen fassen sie wesentlich mehr Orga-Mappen als normale Boxen. So haben Sie alle aktuellen und wichtigen Vorgänge immer im Blick. Im Gegensatz zu Acryl-Boxen ist der Acryl-Ständer seitlich offen. Darin können lateral (seitlich) bereiterte Orga-Mappen oder größere Formate eingestellt werden.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(179,	20314,	'c642e797668c4d7382259a1c1477eec0',	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	'Lateral-Boxen',	NULL,	'seitlich offen, für lateral (seitlich) bereiterte Orga-Mappen. In Regalen und Schränken untergebracht, bilden sie die Lateralablage. Vorteil: Mappen können direkt eingesehen und gegriffen werden, ohne die Box zu entnehmen. Nachteil: schlechte Unterbringung am Schreibtisch.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(180,	20315,	'64fe53ff975c46158f23c0c04b4c5195',	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	'Sammler',	NULL,	'<p>haben wie die Boxen ein unveränderliches Füllvermögen. Sie sind vorgesehen für Handakten, zum Zusammenstellen, Gruppieren und Gliedern von Orga-Mappen. Sie werden flach geliefert, sind einfach aufzustellen und passen in alle Orga-Boxen.</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(181,	20317,	'83093079509840a580487ef3b931cce6',	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	'Archiv-Boxen',	NULL,	'zur Archivierung (Altablage) und staubgeschützten Aufbewahrung von Orga-Mappen oder sonstigem Schriftgut. Die meisten Boxen haben eine verschließbare, leicht zu öffnende Klappe. Sie werden flach geliefert und sind mit wenigen Handgriffen aufgestellt.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(182,	20318,	'0e197fa61ac2499795db7784fda7d0de',	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	'Mappenstützen',	NULL,	'zum Abstützen der Orga-Mappen in wenig gefüllten Orga-Boxen. Sie gibt sie federnd nach und kann bei wachsendem Mappen-Inhalt mehrfach in eine neue Box umgesetzt werden.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(183,	20319,	'066680c683c147da9bfc127630c0b651',	20003,	'647123501a8f4e01bd85b4b1e3eb9db0',	'Rückenschilder',	NULL,	'zur Kennzeichnung der Orga- und Archivboxen. Sie sind selbstklebend und werden direkt auf die Seiten-(Rücken-) Fläche der Boxen aufgeklebt. Wird die Beschriftung oft geändert, empfiehlt sich, eine selbstklebende Sichttasche (ArtNr. 442050) zu verwenden, in die das Rückenschild (ArtNr. 404100) eingesteckt und ausgewechselt werden kann.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(184,	20410,	'a82f511cd7074e838f1e6273a162c279',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Heftvorrichtungen',	NULL,	'für geheftete Schriftgutablage. Sie sind an beliebiger Stelle in Orga-Mappen, Dehnsammlern, Aktendeckeln und dergleichen einzukleben. Belege können damit verbunden und später in Mappen eingeklebt werden.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(185,	20411,	'b5c51d92d3684778a6476f766746b245',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Zwischenheftvorrichtungen',	NULL,	'eignen sich besonders zum Dazu- und Zwischenheften von Schriftstücken in Sammelmappen und Dehnsammlern (ArtNr. 134050). Mit Einklebeplatte eignet sich die Heftvorrichtung auch für alle Mappen ab 170 g/m2. Vorteil: Leichtes Zwischenheften und der Inhalt ist flach aufzuschlagen wie ein Buch.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(186,	20412,	'7777f1008b174695a70df1f8ae160811',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Einklebetaschen',	NULL,	'transparent und selbstklebend, zur raumsparenden Aufbewahrung von BluRays, DVDs, CDs, Visitenkarten oder kleineren Belegen usw.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(187,	20413,	'f3a40e3c186a446a9cbaec6806a6e1f3',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Leitkarten',	NULL,	'zum Gliedern, Gruppieren und Unterteilen von Orga-Mappen in Orga-Boxen',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(188,	20414,	'50b98afa0232405eb26da0b84e091f52',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Tab-Umsetzer',	NULL,	'zum Versetzen der Quick-Tabs z.B. für Terminierung, wechselnde Beschriftung usw. Er wird am oberen Rand der Orga-Mappe angeklebt. Der Tab haftet fest an, lässt sich aber doch langsam lösen.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(189,	20415,	'6fa37db170834974a4ea92db147a3662',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Einklebeklappen',	NULL,	'sind gefalzte, selbstklebende Klappen. Kleinere Formate, z. B. Kontoauszüge, können im Inneren der Mappe neben- oder untereinander aufbewahrt werden.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(190,	20416,	'2e1bcf98880a4296b1ef5c3c6f791157',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Trennstreifen',	NULL,	'unterteilen den Mappeninhalt und können wie bei einem Register beschriftet werden.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(191,	20417,	'e0a46ba97eec4de691b4ff5da7a9ea12',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Klarsichtfenster',	NULL,	'mit rückseitiger Selbstklebefläche zur Beschriftung von Regalen, Schränken, Kästen und Tafeln',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(192,	20418,	'50feb31d26fa47f2a147dc3921045656',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Entnahmekarten',	NULL,	'mit Quittungsvordruck werden an Stelle der entnommenen Akten eingestellt.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(193,	20420,	'4a266a9e4d3a47ecbf896620e43f1096',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Koffer | Transport',	NULL,	'Ideal für den Transport von Classei-Unterlagen zu Meetings, Vorträgen oder Besprechungen. Alle GO-Boxen und Koffer sind sehr handllch und leicht.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(194,	20421,	'1a40a79eff2a48d5b2206e0aa7e7352b',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Literatur',	NULL,	'zum Weiterlesen',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(195,	20422,	'9824545799f245b3afc26c56fd7003b3',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Beschriftungs-Schilder',	NULL,	'für Strip-Tabs und Fensterreiter. Verfügbare Farben 00-09, siehe unten',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(196,	20423,	'5b594e778d944a5297a06bfbb277bf42',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Tab-Beschriftung',	NULL,	'<p>einfach und schnell beschriften. Hinweise zu Beschriftungsmöglichkeiten</p>\r\n<div class=\"block-group\">\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel is--highlight\">\r\n            <div class=\"panel--header\">Classei Online Druck</div>\r\n            <div class=\"panel--body\">Mit unserem kostenlosen Online Service k&ouml;nnen Sie Classei-Orga-Tabs ganz einfach selbst beschriften und ausdrucken.<br /> Ganz ohne Installation - sofort loslegen</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/media-center/classei-online-druck.html\">Zum Online-Druck</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Farbskala PDF</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=139&amp;type=thumb\" /> Als &Uuml;berblick aller Tab-Farben und zur Einteilung Ihrer Organisation laden Sie sich hier unsere Farbskala herunter.</div>\r\n            <div class=\"panel--footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/send/5-systembeschreibungen/23-classei-farbskala-als-aktenplan.html\">Herunterladen</a></div>\r\n        </div>\r\n    </div>\r\n    <div class=\"span4 block\">\r\n        <div class=\"panel\">\r\n            <div class=\"panel--header\">Druckvorlagen</div>\r\n            <div class=\"panel--body\"><img style=\"float: left; margin-right: 10px; margin-bottom: 10px;\" alt=\"Die Classei Farbskala\" src=\"https://www.classei.de/index.php?option=com_joomgallery&amp;view=image&amp;format=raw&amp;id=143&amp;type=thumb\" /> Die richtige Tab-Druckvorlage f&uuml;r die verschiedenen Tab-B&ouml;gen k&ouml;nnen Sie auf dieser Seite ausw&auml;hlen. Einfach in Word &ouml;ffnen und loslegen.</div>\r\n            <div class=\"panel-footer\"><a class=\"btn\" target=\"_blank\" href=\"https://www.classei.de/de/service/downloads/category/4-tab-druckvorlagen.html\">Ausw&auml;hlen</a></div>\r\n        </div>\r\n    </div>\r\n</div>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(197,	20424,	'97617c1b95a74c939950c1495d0fbc69',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Mappenstützen',	NULL,	'dienen zum Abstützen der Orga-Mappen in wenig befüllten Orga-Boxen.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(198,	20425,	'64aac9ce8fd44e26a159dc96d61bce15',	20004,	'2fbbb6104c354234acc9eb6d45d7311f',	'Sichthüllen',	NULL,	'in diesen Sichthüllen/-mappen können Sie den Inhalt bearbeiten und blättern, ohne ihn entnehmen zu müssen. ',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(199,	20510,	'f891776dd33a4602894808d70b3cdabe',	20005,	'23729f8632b74d759f6157006a8cdc02',	'Arbeitsplatzorganisation',	NULL,	'Es sind bewährte und sinnvolle Zusammenstellungen. Damit können Sie sofort starten, ohne lange zu überlegen. Zudem haben die Sets auch einen Preisvorteil\r\n<br><span style=\"color:red; font-weight:bold;\">Empfehlungstipp für den Start:</span> Das Business-Set oder Business-Set Pro',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(200,	20511,	'8d813ac673be440297ff812eec670616',	20005,	'23729f8632b74d759f6157006a8cdc02',	'Terminverfolgung',	NULL,	'<table width=\"100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width:50%\"><iframe width=\"356\" height=\"200\" frameborder=\"0\" allowfullscreen=\"\" mozallowfullscreen=\"\" webkitallowfullscreen=\"\" src=\"https://player.vimeo.com/video/41014047?byline=0&amp;portrait=0&amp;badge=0&amp;color=ffffff\"></iframe></td>\r\n            <td style=\"valign:bottom; width:5%\"></td>\r\n            <td style=\"valign:bottom; width:40%\">\r\n            <h4>Hier finden Sie bew&auml;hrte und sinnvolle Zusammenstellungen. Damit k&ouml;nnen Sie sofort starten, ohne lange zu &uuml;berlegen. <br />\r\n            Zudem haben die Sets auch einen Preisvorteil!</h4>\r\n            </td>\r\n            <td style=\"valign:bottom; width:5%\"></td>\r\n        </tr>\r\n    </tbody>\r\n</table>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(201,	20512,	'd4d359da34e34d30a7973a9239b7f3c0',	20005,	'23729f8632b74d759f6157006a8cdc02',	'Orga-Sets',	NULL,	'Es sind bewährte und sinnvolle Zusammenstellungen. Damit können Sie sofort starten, ohne lange zu überlegen. Zudem haben die Sets auch einen Preisvorteil!',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(202,	20513,	'fc300c4d0e0d463c9fa52d278db2b50e',	20005,	'23729f8632b74d759f6157006a8cdc02',	'Ergänzungs-Sets',	NULL,	'<p>Hier finden Sie eine Auswahl an Ergänzungen für die Terminverfolgung. Wir bieten Ergänzungen in diesen 4 verschiedenen Ausführungen:</p><p>Standard-Mappen <strong>20 41 16</strong><br />Elegance-Mappen <strong>20 40 45/00 weiß</strong><br />Kunsststoff-Mappen <strong>20 44 50</strong><br />Leitkarten <strong>50 40 32</strong></p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(203,	20514,	'd60b90be0c3e4347a0f9d10574f713f6',	20005,	'23729f8632b74d759f6157006a8cdc02',	'White-Edition',	NULL,	'<p><strong>Elegante</strong> und <strong>funktionelle</strong> Organisation für Ihren Arbeitsplatz mit der neuen Serie <strong>White Edition</strong> von Classei. Die fein abgestimmte <strong>weiße Mappenserie</strong> ist für jede Vorgangsart geeignet. Classei bietet die repräsentativen Mappen in drei unterschiedlichen Ausführungen an.</p>\r\n<p>Zudem ist die White-Edition kombiniert mit <strong>attraktiven Acrylglas-Boxen</strong> als fertige Sets erhältlich. Sofort startklar - so macht das Arbeiten mit dem Classei-System rund um den Schreibtisch noch mehr Spaß.</p>\r\n<p>Wir haben für Sie <strong>2 verschiedene Sets</strong> zusammengestellt, welche sich nur durch die enthaltene Acrylglas Box unterscheiden.</p>',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(204,	20515,	'bc31519c71a34ba8b7908ec4a9677858',	20005,	'23729f8632b74d759f6157006a8cdc02',	'HomeOffice Edition',	NULL,	'',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(205,	20610,	'16ad5f4798944f098cc45db42f1eb4bd',	20006,	'cff45e70ad11403c9a907cdc2d48ce2d',	'Schreibtisch-Set',	NULL,	'enthält alles, um mit der Aufgaben- und Projekt-Planung sofort beginnen zu können. Einfach auf dem Schreibtisch gut sichtbar aufstellen und schon kann es losgehen. Zukünftig haben Sie all Ihre Vorhaben und geplanten Aktivitäten vor Augen. Sie übersehen oder vergessen nichts mehr.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(206,	20611,	'c83221d7557c400ebfddd9ab96ade12a',	20006,	'cff45e70ad11403c9a907cdc2d48ce2d',	'Plantafeln',	NULL,	'nehmen die Plankarten und Planblätter auf, welche schuppenförmig angeordnet werden. Mit dem selbstklebenden Fensterreiter können die einzelnen Plantafeln gekennzeichnet werden, wie z.B. Tagesplan, Projekt XY oder Wichtig usw.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(207,	20612,	'5454724de1324177930410f1e048e190',	20006,	'cff45e70ad11403c9a907cdc2d48ce2d',	'Planständer',	NULL,	'',	'2022-10-28 08:29:05',	'2023-02-16 16:10:16'),
(208,	20613,	'de61f141d2e147e2b0ed6ae87af19708',	20006,	'cff45e70ad11403c9a907cdc2d48ce2d',	'Blattständer',	NULL,	'nehmen Blankoplanblätter zur griffbereiten Benutzung auf.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(209,	20614,	'eda75dc8e0484021aeea7b6d886a08c8',	20006,	'cff45e70ad11403c9a907cdc2d48ce2d',	'Planblätter',	NULL,	'zur Aufzeichnung von Aufgaben, Aktivitäten und Ideen. Sie sind alle mit einem Organisationsdruck versehen. Für das normale Tagesgeschehen werden Planblätter 80g/m2 oder Plankarten 170g/m2 verwendet. Für Aufgaben, die sich in ihrer Priorität unterscheiden, werden farbige Planblätter verwendet. Für Team- oder Delegationsarbeit gibt es Planblätter mit Durchschrift.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(210,	20615,	'd0abf2dc08984c098e85d858502e128a',	20006,	'cff45e70ad11403c9a907cdc2d48ce2d',	'Planer',	NULL,	'für Aufzeichnungen und Notizen unterwegs. Im handlichen DIN A6-Format ist er ausgestattet mit einem Block Planblätter und einem Jahreskalender. Er ist jederzeit zu ergänzen mit einem Adress- und Telefonregister.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(211,	20616,	'8aab6ede70ec421aa2ea887a774848ce',	20006,	'cff45e70ad11403c9a907cdc2d48ce2d',	'Planständer',	NULL,	'nehmen mit den drei Fächern bis zu sechs Plantafeln auf und sind mit zusätzlichem Mappenfach ausgestattet.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(212,	20710,	'7877fc2af0e94425b7210d7d1d35d27b',	20007,	'5bca2aa3873d41558ad747af52cc2e91',	'Classata-Schränke Typ 60',	NULL,	'Gehäuse aus 1,25 mm Stahlblech. Voll ausziehbare Schübe auf rostfreien Teleskopschienen mit Überauszug und 110 kg Tragkraft pro Schub. Zentralverriegelung und Einzelschubsperre für absolute Kippsicherheit. Fünf Schübe auf Stahlkugellagerrollen für ruhigen Lauf. Gerundete Ecken für höchste ergonomische Ansprüche. Verchromte Bügelgriffe.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(213,	20711,	'f10c4c28d10c4594b4fe7a1187a389dd',	20007,	'5bca2aa3873d41558ad747af52cc2e91',	'Classata-Schränke Typ 47',	NULL,	'bieten viel Platz auf kleinster Fläche mit optimalem Aktenzugriff. Mit einer Tiefe von nur 50 cm und durchgehender innen liegender Griffleiste sind diese Schränke hervorragend geeignet für das Home-Office, kleine Büros und schmale Gänge.\r\nTiefe: 50 cm, \r\nBoxen pro Schub: 12',	'2022-02-15 09:15:57',	'2023-02-16 16:10:16'),
(214,	20712,	'a8daeace10084caa827412647fb4b4ad',	20007,	'5bca2aa3873d41558ad747af52cc2e91',	'Classei-Mobil',	NULL,	'Mit diesen neuen Rollmöbeln bringt Classei Mobilität ins Büro. Sie fassen insgesamt 12 Orga-Boxen. Durch die leichtgängigen Rollen und die kompakten Ausmaße sind sie sehr flexibel und an jedem Arbeitsplatz einsetzbar.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16'),
(215,	20713,	'01b672d668ac429391898c3fc82d2252',	20007,	'5bca2aa3873d41558ad747af52cc2e91',	'Classei-Auszug',	NULL,	'Der Classei-Auszug kann bis zu 3 Orga-Boxen fassen. Problemlos auf Fachböden in Schränken und Regalen zu montieren. Der Überauszug ist Ideal um mehr Orgaboxen hintereinander oder nebeneinander zu verstauen, ohne auf die Zugänglichkeit achten zu müssen.',	'2021-12-06 09:57:33',	'2023-02-16 16:10:16');
