(92,	'https://assets.classei.de/img/',	'104523',	'jpg',	'',	'zur Archivierung (Altablage) und staubgeschützten Aufbewahrung von Orga-Mappen oder sonstigem Schriftgut. Einfaches, leichtgängiges Aufstellen für sofortiges Einlegen der Mappen oder DIN A4 Unterlagen. Mit sicherem Staubdeckelverschluss.\r\n<br><br>\r\n<strong>Material:</strong> Karton/Feinwelle<br>\r\n<strong>Farbe:</strong> weiß<br>\r\n<strong>Breite:</strong> 335 mm<br>\r\n<strong>Höhe:</strong> 40 mm<br>\r\n<strong>Tiefe:</strong> 250 mm'),
