(126,	'https://assets.classei.de/img/',	'204011',	'jpg',	'',	'<p>Sie nehmen Ihre Dokumente sicher auf und besteht aus 170 g/m² stabilem Recycling-Papier. Eine universelle Organisationsleiste bietet eine Vielfalt an Einsatzmöglichkeiten. Integrierte Seitenklappen schützen Ihre Dokumente gegen Herausfallen und geben der Mappe Standstabilität.</p><b>Material:</b>100% Recycling-Papier FSC® 170 g/m²<br><b>Farbe:</b> weiss<br><b>Blattkapazität:</b> bis 80 bei 80 g Papier<br><b>Außenmaße:</b> B 315 mm x H 225 mm'),
(127,	'https://assets.classei.de/img/',	'204013',	'jpg',	'',	'<p>Eine universelle Organisationsleiste bietet eine Vielfalt an Einsatzmöglichkeiten. Daher ist sie ideal für dünne Vorgänge und größere Unterteilungen der Ablage. Das ist wichtig, denn klein gehaltene Vorgänge erhöhen die Ordnungssystematik.</p>\r\n<p>\r\n<b>Material:</b> Recy.- Karton 130 g/m²<br>\r\n<b>Farbe:</b> hellbraun<br>\r\n<b>Blattkapazität:</b> bis 80 bei 80 g Papier<br>\r\n<b>Außenmaße:</b> B 315 mm x H 225 mm\r\n</p>'),
(128,	'https://assets.classei.de/img/',	'204021',	'jpg',	'',	'nehmen Ihre DIN A4- Dokumente sicher und geschützt auf. Bestehend aus 100% Recycling-Papier 120 g/m²<br><br><b>Material:</b> 100% Rec.-Papier 120 g/m²<br><b>Farbe:</b> hellgrau<br><b>Blattkapazität:</b> bis 40 bei 80 g Papier<br><b>Außenmaße:</b> B 315 mm x H 225 mm<br>'),
