(154,	'https://assets.classei.de/img/',	'204451_03',	'jpg',	'',	'Sie besteht aus glasklarer Kunststoff-Folie, 250 g/qm und eine universelle Organisationsleiste bietet eine Vielfalt an Einsatzmöglichkeiten. Integrierte Seitenklappen schützen Ihre Dokumente gegen Herausfallen und geben der Mappe Standstabilität.<br>\r\n<br>\r\n<strong>Beschriftung:</strong>\r\nQuick-Strip, 59 10 .. (Farben: 00 weiss, 01 gelb, 02 rot, 06 grün)'),
(155,	'https://assets.classei.de/img/',	'204461',	'jpg',	'',	'Sie besteht aus extra-starker, transluzenter PP-Kunststoff-Folie, Ausführung wie 20 44 62 nur ohne Schiebeleiste'),
(156,	'https://assets.classei.de/img/',	'204461_02',	'jpg',	'',	'Sie besteht aus extra-starker, transluzenter PP-Kunststoff-Folie, Ausführung wie 20 44 62 nur ohne Schiebeleiste'),
(157,	'https://assets.classei.de/img/',	'beispiel_strip-tabs',	'jpg',	'',	'Sie besteht aus extra-starker, transluzenter PP-Kunststoff-Folie. An einer integrierten Schiebeleiste befindet sich ein verschiebbarer Fenster-Reiter, dessen Beschriftung mit verschiedenfarbigen Einsteck-Schildchen geändert werden kann. Er ist leicht auf eine neue Position zu schieben. Die Multifunktions-Mappe ist daher hervorragend geeignet für kurzfristige oder schwebende Vorgänge. Sie kann so mehrfach wieder verwendet werden. Für die austauschbaren Einsteck-Schildchen wird der Strip-Bogen (ArtNr. 6010..) in zehn Farben verwendet.'),
(158,	'https://assets.classei.de/img/',	'900006',	'jpg',	'',	'<p>Perfekt für Aufgaben am modernen Schreibtisch</p>\r\n<p>\r\n<strong>Das Profi-Set beinhaltet:</strong><br/>\r\n1 Acrylglas-Box (ArtNr. 104070)<br/>\r\n10 Multifunktions-Mappen, mit Schiebereiter, transparent (ArtNr. 204462)<br>\r\n30 Standard-Mappen (ArtNr. 204116)<br/>\r\n10 Dehn-Mappen (ArtNr. 214123)<br/>\r\n1 Mappenstütze (ArtNr. 574370)<br>\r\n1 Bogen Quick-Tabs, gelb (ArtNr. 581001)<br>\r\n1 Bogen Quick-Tabs, rot (ArtNr. 581002)<br>\r\n1 Folienschreiber (ArtNr. 450313)</p>'),
(159,	'https://assets.classei.de/img/',	'204462',	'jpg',	'',	'aus stabiler Klarsichtfolie (PVC), mit weissem  Beschriftungs-Schild, auswechselbar'),
(160,	'https://assets.classei.de/img/',	'204462_02',	'jpg',	'',	'Sie besteht aus extra-starker, transluzenter PP-Kunststoff-Folie. An einer integrierten Schiebeleiste befindet sich ein verschiebbarer Fenster-Reiter, dessen Beschriftung mit verschiedenfarbigen Einsteck-Schildchen geändert werden kann. Er ist leicht auf eine neue Position zu schieben. Die Multifunktions-Mappe ist daher hervorragend geeignet für kurzfristige oder schwebende Vorgänge. Sie kann so mehrfach wieder verwendet werden. Für die austauschbaren Einsteck-Schildchen wird der Strip-Bogen (ArtNr. 6010..) in zehn Farben verwendet.'),
