(163,	'https://assets.classei.de/img/',	'214023',	'jpg',	'',	'<p>nehmen Ihre DIN A4- Dokumente sicher und geschützt auf. Bestehend aus stabilem Natronkarton und mit einer Dehnfalte ausgestattet.</p>\r\n<p>\r\n<b>Material:</b> Recy.- Karton 230 g/m²<br>\r\n<b>Farbe:</b> hellbraun<br>\r\n<b>Blattkapazität:</b> bis 200 bei 80 g Papier<br>\r\n<b>Außenmaße:</b> B 315 mm x H 225 mm mit 20 mm Dehnfalte</p>'),
(164,	'https://assets.classei.de/img/',	'214025',	'jpg',	'',	'<p>ist aus stabilem Karton und mit einer Dehnfalte ausgestattet</p>\r\n<p>Sie passt sich dem wachsenden Inhalt an. Eine Mappe fasst bis zu 200 Blatt Papier. Daher ideal für voluminöse Vorgänge, umfangreiche Verträge, Broschüren oder Prospekte. </p>\r\n<p>\r\n<b>Material:</b> Karton 250 g/m²<br>\r\n<b>Farbe:</b> weiß<br>\r\n<b>Blattkapazität:</b> bis 200 bei 80 g Papier<br>\r\n<b>Außenmaße:</b> B 315 mm x H 225 mm mit 20 mm Dehnfalte\r\n</p>'),
(165,	'https://assets.classei.de/img/',	'214045',	'jpg',	'',	'<p>Sie besteht aus stabilem 250 g/m² Karton, cellophaniert (foliert). Das macht die Mappe nicht nur sehr attraktiv, sondern auch reißfester und abwischbar. Somit eignet sie sich auch als Angebots-, Präsentations- und Info-Mappe. Durch die Dehnfalte passt sich die Mappe an einen wachsenden Inhalt, bis zu 200 Blatt Papier, an.</p><p>\r\n<b>Material:</b> Beschichteter Karton 250 g/m²\r\n<br><b>Farbe:</b> weiß\r\n<br><b>Blattkapazität:</b> bis 200 bei 80 g Papier\r\n<br><b>Außenmaße:</b> B 315 mm x H 225 mm\r\n</p>'),
(166,	'https://assets.classei.de/img/',	'214123',	'jpg',	'',	'nehmen Ihre Dokumente sicher und geschützt auf. Stabiler Natronkarton und mit einer Dehnfalte ausgestattet'),
