(171,	'https://assets.classei.de/img/',	'224413_02',	'jpg',	'',	'Sie besteht aus starkem Papier, 170 g/qm, hellgelb und ist ausgestattet mit einer zweiseitig offenen Klarsichthülle (ArtNr. 224551) als Vorderseite. Dokumente oder Datenblätter sind so geschützt und separat aufbewahrt. Alle wichtigen Daten sind direkt sichtbar.'),
(172,	'https://assets.classei.de/img/',	'224453',	'jpg',	'',	'<p>Sie besteht aus starker PP-Folie, 190 g/qm. Der Inhalt der einliegenden Blätter bleibt zum Lesen oder Bearbeiten in der Sichtmappe. Durch die aufgedruckte Organisationsleiste und den wiederablösbaren QuickStrips sind die Blättersicht-Mappen voll in die Classei-Ablage integrierbar.<br/> <br/><strong>Hinweis: </strong><br/>Zum Beschriften der Mappe verwenden Sie <strong>QuickStrip 59 10 ..</strong></p>'),
