(479,	'https://assets.classei.de/img/',	'584470',	'jpg',	'',	'<p>Der Planständer nimmt mit den 3 Fächern, die seitlich offen sind, bis zu 6 Plantafeln auf und ist mit zusätzlichem Mappenfach ausgestattet</p>\r\n<p>\r\n<strong>Material:</strong> Acrylglas<br/>\r\n<strong>Farbe:</strong> transparent<br/>\r\n<strong>Stärke:</strong> 4 mm<br/>\r\n<strong>Breite:</strong> 310 mm<br/>\r\n<strong>Höhe:</strong> 170 mm<br/>\r\n<strong>Tiefe:</strong> 165 mm\r\n</p>'),
(480,	'https://assets.classei.de/img/',	'584470_02',	'jpg',	'',	'<p>Der Planständer nimmt mit den 3 Fächern, die seitlich offen sind, bis zu 6 Plantafeln auf und ist mit zusätzlichem Mappenfach ausgestattet</p>\r\n<p>\r\n<strong>Material:</strong> Acrylglas<br/>\r\n<strong>Farbe:</strong> transparent<br/>\r\n<strong>Stärke:</strong> 4 mm<br/>\r\n<strong>Breite:</strong> 310 mm<br/>\r\n<strong>Höhe:</strong> 170 mm<br/>\r\n<strong>Tiefe:</strong> 165 mm\r\n</p>'),
(481,	'https://assets.classei.de/img/',	'910000_03',	'jpg',	'',	'<p>\r\nAlle Termine und Projekte im Überblick halten.\r\n</p>\r\n<p>\r\n<strong>Das Schreibtisch-Set beinhaltet:</strong>\r\n<br>1 Acrylglas-Planständer (ArtNr. 584470)\r\n<br>3 Plantafeln (ArtNr. 626026) mit Fenster-Reiter (Tages-, Wochen-, Monatsplan)\r\n<br>1 Blattständer (ArtNr. 586170) mit <br/>\r\n100 Planblätter (ArtNr. 806008)\r\n</p>'),
(482,	'https://assets.classei.de/img/',	'586170',	'jpg',	'',	'<p>\r\nNimmt Blankoplanblätter (806008 90g/m², 806017 170g/m² und 806308 90g/m² bunt) zur griffbereiten Benutzung auf.\r\n</p>\r\n<p>\r\n<b>Material:</b> Acrylglas<br>\r\n<b>Farbe:</b> transparent<br>\r\n<b>Stärke:</b> 4 mm<br>\r\n<b>Breite:</b> 150 mm<br>\r\n<b>Höhe:</b> 85 mm<br>\r\n<b>Tiefe:</b> 50 mm\r\n</p>'),
