(39,	'104016',	'd586275dff264258a77b16f39eab6f94',	'104016 Orga-Hartpappebox (FSC®), schwarz',	'[{\"name\": \"104016\", \"type\": \"jpg\"}, {\"name\": \"104016_02\", \"type\": \"jpg\"}, {\"name\": \"104016_03\", \"type\": \"jpg\"}, {\"name\": \"104016_04\", \"type\": \"jpg\"}]',	7.6,	25,	7.4,	0,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:10:59',	20,	'<p>Dienen zum Abstellen von Orga-Mappen. Bestehend aus stabiler und robuster Recycling-Hartpappe mit Lederprägestruktur (mit Umweltzeichen Blauer Engel sowie FSC®).<br>Sie wird flach geliefert und benötigt daher wenig Lagerraum. Im Handumdrehen ist sie durch den leicht bedienbaren Steckbodenverschluss aufgestellt.</p>\r\n<p><strong>Material:</strong> 100% Recycling-Hartpappe<br>\r\n<strong>Farbe:</strong> schwarz<br>\r\n<strong>Stärke:</strong> 1,2 mm<br>\r\n<strong>Breite:</strong> 325 mm<br>\r\n<strong>Höhe:</strong> 220 mm<br>\r\n<strong>Tiefe:</strong> 100 mm</p>',	'<p>Dienen zum Abstellen von Orga-Mappen. Bestehend aus stabiler und robuster Recycling-Hartpappe mit Lederprägestruktur (mit Umweltzeichen Blauer Engel sowie FSC®).<br>Sie wird flach geliefert und benötigt daher wenig Lagerraum. Im Handumdrehen ist sie durch den leicht bedienbaren Steckbodenverschluss aufgestellt.</p>\r\n<p>\r\n    <b>Material:</b> 100% Rec.-Hartpappe<br/>\r\n    <b>Farbe:</b> schwarz<br/>\r\n    <b>Stärke:</b> 1,2 mm<br/>\r\n    <b>Breite:</b> 325 mm<br/>\r\n    <b>Höhe:</b> 220 mm<br/>\r\n    <b>Tiefe:</b> 100 mm\r\n</p>',	'104016-Orga-Hartpappebox-FSC-r-schwarz'),
(40,	'104025',	'4c9ee2e3b45c4e31bd35a66be4c9f877',	'104025 Orgaboxen schwarz, Designer-Karton',	'[{\"name\": \"104025\", \"type\": \"jpg\"}, {\"name\": \"104025_02\", \"type\": \"jpg\"}]',	4.95,	25,	4.75,	853,	0,	1,	1,	NULL,	'2023-02-16 16:10:16',	1,	'2023-02-16 16:10:59',	20,	'<p>\r\nDienen zum Abstellen von Orga-Mappen. Diese Box ist <strong>einzigartig</strong>, da es äußerst schwierig ist, dass Material \r\n<strong>Designer-Karton mit Rippenprägung</strong> in dieser Form zu verarbeiten.\r\n</p>\r\n<p>\r\nSie ist mit einem Blitzboden, ein im Handumdrehen leicht bedienbarer Schnappverschluss, \r\nversehen und daher noch einfacher aufzustellen als bisher. Sie wird flach geliefert und benötigt \r\ndaher wenig Lagerraum. \r\n</p>\r\n<p>\r\nDie offene Welle mit neuem rundem Eingriff verleiht Schlichtheit und Eleganz zugleich und ist \r\nzudem stabil mit gutem Stand.	\r\n</p>\r\n<p><strong>Material: </strong>Desig.-Karton - off. Welle\r\n<br>\r\n<strong>Farbe: </strong>schwarz\r\n<br>\r\n<strong>Stärke: </strong>1,0 mm\r\n<br>\r\n<strong>Breite: </strong>325 mm\r\n<br>\r\n<strong>Höhe: </strong>220 mm\r\n<br>\r\n<strong>Tiefe: </strong>105 mm\r\n</p>',	'<p>\r\nDienen zum Abstellen von Orga-Mappen. Diese Box ist <strong>einzigartig</strong>, da es äußerst schwierig ist, dass Material \r\n<strong>Designer-Karton mit Rippenprägung</strong> in dieser Form zu verarbeiten.\r\n</p>\r\n<p>\r\nDie offene Welle mit neuem rundem Eingriff verleiht Schlichtheit und Eleganz zugleich und ist \r\nzudem stabil mit gutem Stand.	\r\n</p>\r\n<p><strong>Material: </strong>Designer-Karton - offene Welle\r\n<br>\r\n<strong>Farbe: </strong>schwarz\r\n<br>\r\n<strong>Stärke: </strong>1,0 mm\r\n<br>\r\n<strong>Breite: </strong>325 mm\r\n<br>\r\n<strong>Höhe: </strong>220 mm\r\n<br>\r\n<strong>Tiefe: </strong>105 mm\r\n</p>',	'104025-Orgaboxen-schwarz-Designer-Karton'),
